    "zh-TW": "Loading...",
    hr: 'GREŠKA POSLUŽITELJA. Čini se da vaša studija nije dostupna (404) na poslužitelju Pavlovia. Postoji nekoliko načina na koje se to može dogoditi. Evo kako možete riješiti problem:\n1. Možda je to bio trenutni problem, sada nestao. Možda je Pavlovia sporo stavljala studiju na raspolaganje ili je došlo do privremenog prekida rada zbog velikog prometa poslužitelja. Pokušajte osvježiti stranicu za učenje klikom na gumb za osvježavanje ↻ u adresnoj traci vašeg preglednika. Možete pokušati više puta. Ako postane dostupno, vaša će se studija odvijati normalno.\n2. Ako to ne uspijete, na stranici EasyEyes kompilatora kliknite gumb "Idi na Pavlovia" (donja desna strana stranice) da biste otvorili nadzornu ploču Pavlovia za svoju studiju.\n3. Na nadzornoj ploči Pavlovia, provjerite je li vaša studija u načinu rada "RUNNING". Ako je NEAKTIVAN, tada pritisnite tipku RUNNING. Za dvije sekunde vaša će se studija prebaciti u način RADA i sada se može izvoditi normalno. Vratite se na stranicu kompilatora EasyEyes i kliknite POKRENI ili upotrijebite URL studije.\n4. Ako je vaša nedostupna studija već u RUNNING načinu rada, to obično znači da vašoj studiji nedostaje kredit/licenca za plaćanje online testiranja. Postoje tri načina za nastavak.\n5. PILOTIRAJTE BESPLATNO S KONTROLNE PLOČE PAVLOVIA. Ako želite, možete kliknuti gumb PILOTIRANJE na nadzornoj ploči Pavlovia kako biste svoju studiju stavili u PILOTIRANJE. Pokrenite svoju studiju pritiskom na tipku PILOT (na nadzornoj ploči Pavlovia). To je besplatno, ali URL vašeg studija ostaje nedostupan.\n6. POTVRDI ONLINE UZ KREDIT. Da biste radili online, na istoj nadzornoj ploči možete kupiti kredite od Pavlovia i dodijeliti neke ovom istraživanju. To će omogućiti izvođenje ove studije online.\n7. RADITE ONLINE S LICENCOM. EasyEyes ima licencu za web mjesto za Pavlovia. Pišite na denis.pelli@nyu.edu i zatražite da se vaša adresa e-pošte uključi u licencu za web mjesto EasyEyes Pavlovia. (Ili, ako vaša ustanova ima licencu za mjesto Pavlovia, možete je koristiti umjesto toga.) Navedite svoju adresu e-pošte na nadzornoj ploči Pavlovia kako biste pokazali da ste licencirani, što će Pavlovia zapamtiti u budućim sesijama. To omogućuje da se sve vaše studije izvode online.',
