    fr: "GUIDE D'INSTALLATION DE L'IMPRIMANTE D'ÉTIQUETTES DYMO\nSuivez ces étapes pour faciliter l'impression d'étiquettes sur votre DYMO LabelWriter 550.\n① Installer le logiciel DYMO\nTéléchargez et installez la dernière version du logiciel DYMO pour votre système d'exploitation depuis le site web d'assistance DYMO :\nhttps://www.dymo.com/support?cfid=user-guide\nDans votre navigateur, accédez à :\nDYMO.WebApi.Mac.Host :\nAssurez-vous que DYMO.WebApi.Mac.Host est actif.\n② Configurer votre navigateur\n▶ Chrome\nAccédez à :\nchrome://flags\nRecherchez TLS dans la barre de recherche.\nDans les résultats TLS, désactivez :\n⚬ Données préliminaires TLS 1.3\n⚬ Accord de clé post-quantique TLS 1.3\n⚬ Utiliser ML-KEM dans TLS 1.3\n⚬ Ignorer les certificats clients TLS si le mode d'identification l'interdit.\nCliquez sur RELANCER en bas.\n▶ Firefox\nAccédez à Paramètres → Rechercher un certificat.\nDécochez « Autoriser Firefox à approuver automatiquement les certificats racines tiers… ».\nRedémarrez Firefox.\n▶ Safari\nAccédez à :\nhttps://127.0.0.1:41951/DYMO/DLS/Printing/StatusConnected\nSi vous y êtes invité, choisissez « Afficher les détails » → « Visiter ce site web »\npour ignorer l'avertissement de sécurité.\n3. Imprimer une étiquette\nAssurez-vous que DYMO.WebApi.Mac.Host est en cours d'exécution.\nCliquez sur le bouton IMPRIMER L'ÉTIQUETTE sur cette page.\n\nPROBLÈME : Si vous ne parvenez toujours pas à imprimer, vérifiez que DYMO.WebApi.Mac.Host est en cours d'exécution ou consultez l'assistance officielle DYMO.\nATTENTION : Réactivez les paramètres de sécurité après l'impression pour maintenir une protection optimale sur votre navigateur.",
