    id: 'PANDUAN PEMASANGAN PRINTER LABEL DYMO\nIkuti langkah-langkah berikut untuk membantu Anda mencetak label pada DYMO LabelWriter 550 Anda.\n① Instal Perangkat Lunak DYMO\nUnduh & Instal perangkat lunak DYMO terbaru untuk OS Anda dari situs web dukungan DYMO:\nhttps://www.dymo.com/support?cfid=user-guide\nDi peramban Anda, buka:\nDYMO.WebApi.Mac.Host:\nPastikan DYMO.WebApi.Mac.Host berjalan.\n② Konfigurasikan Peramban Anda\n▶ Chrome\nBuka:\nchrome://flags\nCari TLS di bilah pencarian.\nDari hasil TLS, nonaktifkan:\n⚬ Data Awal TLS 1.3\n⚬ Perjanjian kunci pasca-kuantum TLS 1.3\n⚬ Gunakan ML-KEM di TLS 1.3\n⚬ Abaikan sertifikat klien TLS jika mode kredensial tidak mengizinkan.\nKlik RELAUNCH di bagian bawah.\n▶ Firefox\nBuka Pengaturan → Cari Sertifikat.\nHapus centang "Izinkan Firefox untuk secara otomatis mempercayai sertifikat root pihak ketiga..."\nMulai ulang Firefox.\n▶ Safari\nBuka:\nhttps://127.0.0.1:41951/DYMO/DLS/Printing/StatusConnected\nJika diminta, pilih\n“Tampilkan Detail” → “kunjungi situs web ini”\nuntuk melewati peringatan keamanan.\n③ Cetak Label\nPastikan DYMO.WebApi.Mac.Host berjalan.\nTekan tombol PRINT LABEL di halaman ini.\n\nMASALAH: Jika Anda masih tidak dapat mencetak, pastikan DYMO.WebApi.Mac.Host sedang berjalan atau hubungi dukungan resmi DYMO.\nPERHATIAN: Aktifkan kembali pengaturan keamanan setelah mencetak untuk menjaga perlindungan terbaik pada peramban Anda.',
