    kn: "Loading...",
    ko: "Loading...",
    lt: "Nepavyko prisijungti prie jūsų MMM. Galbūt telefono naršyklė per sena. Tokiu atveju gali padėti atnaujinti telefono operacinę sistemą. Arba įdiekite „Chrome“ naršyklę ir nustatykite ją kaip numatytąją naršyklę.\n● Tada dar kartą nukreipkite telefono kamerą į aukščiau esantį QR kodą.\n● Norėdami išbandyti kitą telefoną, tiesiog atnaujinkite šį puslapį: spustelėkite ↻ arba spustelėkite adreso juostą ir paspauskite RETURN.",
    ms: "Tidak dapat menyambung ke MMM anda. Mungkin penyemak imbas telefon terlalu lama. Dalam kes itu, ia mungkin membantu untuk menaik taraf sistem pengendalian telefon. Atau pasang penyemak imbas Chrome dan jadikan penyemak imbas lalai.\n● Kemudian, sekali lagi, halakan kamera telefon anda pada kod QR di atas.\n● Untuk mencuba telefon lain, cuma muat semula halaman ini: Klik ↻, atau klik bar alamat dan tekan RETURN.",
    ml: "നിങ്ങളുടെ MMM-ലേക്ക് ബന്ധിപ്പിക്കാൻ കഴിഞ്ഞില്ല. ഒരുപക്ഷേ ഫോണിൻ്റെ ബ്രൗസർ വളരെ പഴയതായിരിക്കാം. അങ്ങനെയെങ്കിൽ, ഫോൺ ഓപ്പറേറ്റിംഗ് സിസ്റ്റം അപ്‌ഗ്രേഡ് ചെയ്യാൻ ഇത് സഹായിച്ചേക്കാം. അല്ലെങ്കിൽ ഒരു Chrome ബ്രൗസർ ഇൻസ്റ്റാൾ ചെയ്ത് അതിനെ ഡിഫോൾട്ട് ബ്രൗസർ ആക്കുക.\n● തുടർന്ന്, ഒരിക്കൽ കൂടി, മുകളിലെ QR കോഡിലേക്ക് നിങ്ങളുടെ ഫോണിൻ്റെ ക്യാമറ പോയിൻ്റ് ചെയ്യുക.\n● മറ്റൊരു ഫോൺ പരീക്ഷിക്കുന്നതിന്, ഈ പേജ് പുതുക്കിയെടുക്കുക: ↻ ക്ലിക്ക് ചെയ്യുക, അല്ലെങ്കിൽ വിലാസ ബാറിൽ ക്ലിക്ക് ചെയ്ത് RETURN അമർത്തുക.",
