    bg: "Не можа да се свърже с вашия MMM. Може би браузърът на телефона (BBB) е твърде стар. В такъв случай може да помогне надграждането на операционната система на телефона. Или инсталирайте браузър Chrome и го направете браузър по подразбиране.\n● След това отново насочете камерата на телефона си към QR кода по-горе.\n● За да опитате с друг телефон, просто опреснете тази страница: Щракнете върху ↻ или щракнете върху адресната лента и натиснете RETURN.",
    "zh-CN":
      "无法连接到您的 MMM。可能是手机浏览器 (BBB) 版本过旧。如果是这样，升级手机操作系统可能会有所帮助。或者安装 Chrome 浏览器并将其设置为默认浏览器。\n● 然后，再次将手机摄像头对准上方的二维码。\n● 要尝试其他手机，只需刷新此页面：点击 ↻，或点击地址栏并按 RETURN 键。",
    "zh-TW": "Loading...",
    hr: "Loading...",
    cs: "Nelze se připojit k vašemu MMM. Možná je prohlížeč telefonu (BBB) příliš starý. V takovém případě může pomoci upgrade operačního systému telefonu. Nebo si nainstalujte prohlížeč Chrome a nastavte jej jako výchozí prohlížeč.\n● Poté ještě jednou namiřte fotoaparát telefonu na QR kód výše.\n● Chcete-li vyzkoušet jiný telefon, obnovte tuto stránku: Klikněte na ↻ nebo klikněte na adresní řádek a stiskněte RETURN.",
    da: "Loading...",
    nl: "Loading...",
    fi: "Loading...",
    fr: "Impossible de se connecter à votre MMM. Le navigateur du téléphone (BBB) est peut-être trop ancien. Dans ce cas, il peut être utile de mettre à jour le système d'exploitation du téléphone. Vous pouvez également installer Chrome et en faire votre navigateur par défaut.\n● Ensuite, pointez à nouveau l'appareil photo de votre téléphone vers le code QR ci-dessus.\n● Pour essayer avec un autre téléphone, actualisez simplement cette page : cliquez sur ↻ ou sur la barre d'adresse et appuyez sur RETOUR.",
    de: "Loading...",
    el: "Δεν ήταν δυνατή η σύνδεση στο MMM σας. Ίσως το πρόγραμμα περιήγησης του τηλεφώνου (BBB) να είναι πολύ παλιό. Σε αυτήν την περίπτωση, μπορεί να βοηθήσει η αναβάθμιση του λειτουργικού συστήματος του τηλεφώνου. Ή εγκαταστήστε ένα πρόγραμμα περιήγησης Chrome και ορίστε το ως προεπιλεγμένο πρόγραμμα περιήγησης.\n● Στη συνέχεια, στρέψτε ξανά την κάμερα του τηλεφώνου σας στον παραπάνω κωδικό QR.\n● Για να δοκιμάσετε ένα άλλο τηλέφωνο, απλώς ανανεώστε αυτήν τη σελίδα: Κάντε κλικ στο ↻ ή κάντε κλικ στη γραμμή διευθύνσεων και πατήστε RETURN.",
