    tr: 'Açıklamasında belirtildiği gibi, bu çalışma gizli/özel bir pencereye ihtiyaç duyuyor ve bu pencerede bu özellik yok. Bunu düzeltebilirsiniz. Safari dışında herhangi bir tarayıcı kullanarak gizli bir pencere açın ve çalışma bağlantısını bu pencerede çalıştırın.\n\nAÇIKLAMA: Tüm büyük tarayıcılar gizli modda pencere açmanıza izin verir, ancak adları değişiklik gösterebilir; örneğin "Gizli", "Gizli", "Özel Tarama" veya "Özel Pencere". Safari dışındaki tüm tarayıcılar, web sayfasının gizli modda olup olmadığını bildirir. Safari her zaman "hayır" der. Gizli mod genellikle gizlilik için kullanılır. EasyEyes ise ses kalibrasyonu için gerekli olan EasyEyes Firebase kütüphanesine erişimi kolaylaştırmak için bu modu kullanır.',
    ur: 'جیسا کہ اس کی تفصیل میں بتایا گیا ہے، اس مطالعہ کو ایک پوشیدگی/نجی ونڈو کی ضرورت ہے، اور یہ ونڈو نہیں ہے۔ آپ اسے ٹھیک کر سکتے ہیں۔ سفاری کے علاوہ کسی بھی براؤزر کا استعمال کرتے ہوئے، ایک پوشیدگی ونڈو کھولیں، اور اس ونڈو میں مطالعہ کا لنک چلائیں۔ \n \nوضاحت: تمام بڑے براؤزرز آپ کو پوشیدگی وضع میں ونڈو کھولنے کی اجازت دیتے ہیں، حالانکہ نام مختلف ہوتا ہے، جیسے "پوشیدگی"، "ان پرائیویٹ"، "پرائیویٹ براؤزنگ"، یا "پرائیویٹ ونڈو"۔ سفاری کے علاوہ تمام براؤزر رپورٹ کرتے ہیں کہ آیا ویب صفحہ پوشیدگی وضع میں ہے۔ سفاری ہمیشہ نہیں کہتا۔ پوشیدگی وضع عام طور پر رازداری کے لیے استعمال ہوتی ہے۔ EasyEyes اسے EasyEyes Firebase لائبریری تک رسائی کو آسان بنانے کے لیے استعمال کرتا ہے، جو آواز کیلیبریشن کے لیے درکار ہے۔',
