    da: 'DIN Android-TELEFON. Vi har brug for detaljer, der specificerer dets mærke og model. Gå til Indstillinger > Om telefonen\neller Indstillinger > System > Om telefonen (tidligere "Om enhed"). \nKopiér produktets eller enheds- eller modelnavnet og modelnummeret til felterne Modelnavn og nummer nedenfor.',
