    he: "Loading...",
    hi: 'आपका Android फ़ोन। हमें इसके ब्रांड और मॉडल से संबंधित विवरण चाहिए। सेटिंग्स > फ़ोन के बारे में\nया सेटिंग्स > सिस्टम > फ़ोन के बारे में (जिसे पहले "डिवाइस के बारे में" कहा जाता था) पर जाएँ।\nउत्पाद या डिवाइस या मॉडल का नाम और मॉडल नंबर नीचे दिए गए मॉडल नाम और नंबर फ़ील्ड में कॉपी करें।',
    hu: "Loading...",
