    tl: 'IYONG Android PHONE. Kailangan namin ng mga detalyeng tumutukoy sa tatak at modelo nito. Pumunta sa Mga Setting > Tungkol sa telepono\no Mga Setting > System > Tungkol sa telepono (dating "Tungkol sa device"). \nKopyahin ang Pangalan ng Produkto o Device o Modelo at numero ng Modelo sa mga field ng Pangalan ng Modelo at numero sa ibaba.',
