    tr: 'Xiaomi TELEFONUNUZ. Modelini belirten bilgilere ihtiyacımız var. Ayarlar > Telefon Hakkında (eski adıyla "Cihaz Hakkında") bölümüne gidin. Model adını (örneğin "Xiaomi Mi 10", "Redmi Note 10", "Poco X3" veya "Black Shark 4") ve Model numarasını aşağıdaki ilgili alanlara kopyalayın. Eski telefonlarda bu bilgileri görmek için Durum\'a basın.',
