    "en-US":
      'YOUR Blackberry PHONE. We need details specifying its model. Go to Settings > About phone (formerly "About device"). The model NAME and (NUMBER) are combined into one line called "Model". Copy the name before the parentheses to Model name below. Copy the letters and numbers inside parentheses to Model number below.',
    ar: 'هاتف بلاك بيري الخاص بك. نحتاج إلى تفاصيل طرازه. انتقل إلى الإعدادات > حول الهاتف (سابقًا "حول الجهاز"). يُدمج اسم الطراز ورقمه في سطر واحد يُسمى "الطراز". انسخ الاسم قبل الأقواس إلى "اسم الطراز" أدناه. انسخ الأحرف والأرقام داخل الأقواس إلى "رقم الطراز" أدناه.',
    hy: "Loading...",
    bg: "Loading...",
    "zh-CN": "Loading...",
    "zh-TW":
      "您的黑莓手機。我們需要您提供其型號的詳細資訊。前往「設定」>「關於手機」（以前稱為「關於裝置」）。型號名稱和（型號）會合併到一行，名為「型號」。請將括號前的名稱複製到下方的「型號名稱」。將括號內的字母和數字複製到下方的「型號編號」。",
    hr: "Loading...",
    cs: 'VÁŠ TELEFON Blackberry. Potřebujeme podrobnosti specifikující jeho model. Přejděte do Nastavení > O telefonu (dříve „O zařízení“). Model NÁZEV a (ČÍSLO) jsou sloučeny do jednoho řádku s názvem "Model". Zkopírujte název před závorkami do názvu modelu níže. Zkopírujte písmena a čísla v závorkách do čísla modelu níže.',
    da: "Loading...",
