    fi: "Loading...",
    fr: "Loading...",
    de: "Loading...",
    el: "Loading...",
    he: 'טלפון ה-Blackberry שלך. אנחנו צריכים פרטים המפרטים את הדגם שלו. עבור אל הגדרות > מידע על הטלפון (לשעבר "אודות המכשיר"). הדגם NAME ו-(NUMBER) משולבים לשורה אחת בשם "דגם". העתק את השם לפני הסוגריים לשם הדגם למטה. העתק את האותיות והמספרים בתוך סוגריים למספר הדגם למטה.',
    hi: 'आपका ब्लैकबेरी फ़ोन। हमें इसके मॉडल से संबंधित विवरण चाहिए। सेटिंग्स > फ़ोन के बारे में (जिसे पहले "डिवाइस के बारे में" कहा जाता था) पर जाएँ। मॉडल का नाम और (संख्या) एक पंक्ति में संयुक्त हैं जिसे "मॉडल" कहा जाता है। कोष्ठकों से पहले दिए गए नाम को नीचे दिए गए मॉडल नाम में कॉपी करें। कोष्ठकों के अंदर दिए गए अक्षरों और संख्याओं को नीचे दिए गए मॉडल नंबर में कॉपी करें।',
    hu: "Loading...",
    is: "Loading...",
    id: 'Ponsel BlackBerry Anda. Kami membutuhkan detail modelnya. Buka Pengaturan > Tentang ponsel (sebelumnya "Tentang perangkat"). NAMA model dan (NOMOR) digabungkan menjadi satu baris bernama "Model". Salin nama di depan tanda kurung ke Nama model di bawah. Salin huruf dan angka di dalam tanda kurung ke Nomor model di bawah.',
    it: "Loading...",
    ja: "Loading...",
    kn: 'ನಿಮ್ಮ ಬ್ಲ್ಯಾಕ್‌ಬೆರಿ ಫೋನ್. ಅದರ ಮಾದರಿಯನ್ನು ನಿರ್ದಿಷ್ಟಪಡಿಸುವ ವಿವರಗಳು ನಮಗೆ ಅಗತ್ಯವಿದೆ. ಸೆಟ್ಟಿಂಗ್‌ಗಳು > ಫೋನ್ ಕುರಿತು (ಹಿಂದೆ "ಸಾಧನದ ಕುರಿತು") ಗೆ ಹೋಗಿ. ಮಾದರಿ NAME ಮತ್ತು (NUMBER) ಅನ್ನು "ಮಾದರಿ" ಎಂಬ ಒಂದು ಸಾಲಿನಲ್ಲಿ ಸಂಯೋಜಿಸಲಾಗಿದೆ. ಆವರಣದ ಮೊದಲು ಹೆಸರನ್ನು ಕೆಳಗಿನ ಮಾದರಿ ಹೆಸರಿಗೆ ನಕಲಿಸಿ. ಆವರಣದಲ್ಲಿರುವ ಅಕ್ಷರಗಳು ಮತ್ತು ಸಂಖ್ಯೆಗಳನ್ನು ಕೆಳಗಿನ ಮಾದರಿ ಸಂಖ್ಯೆಗೆ ನಕಲಿಸಿ.',
    ko: '블랙베리 휴대폰입니다. 모델 정보를 입력해 주세요. 설정 > 휴대폰 정보(이전 명칭: "기기 정보")로 이동하세요. 모델명과 (번호)가 합쳐져 "모델"이라는 한 줄에 표시됩니다. 괄호 앞의 모델명을 아래 모델명에 복사하세요. 괄호 안의 문자와 숫자를 아래 모델 번호에 복사하세요.',
    lt: "JŪSŲ „Blackberry“ TELEFONAS. Mums reikia detalių, nurodančių jos modelį. Eikite į „Nustatymai“ > „Apie telefoną“ (anksčiau „Apie įrenginį“). Modelis PAVADINIMAS ir (NUMBER) yra sujungti į vieną eilutę, pavadintą „Modelis“. Nukopijuokite pavadinimą prieš skliaustus į žemiau esantį modelio pavadinimą. Nukopijuokite raides ir skaičius skliausteliuose į žemiau esantį modelio numerį.",
    ms: 'TELEFON Blackberry ANDA. Kami memerlukan butiran yang menyatakan modelnya. Pergi ke Tetapan > Perihal telefon (dahulunya "Perihal peranti"). Model NAME dan (NUMBER) digabungkan menjadi satu baris yang dipanggil "Model". Salin nama sebelum kurungan ke nama Model di bawah. Salin huruf dan nombor di dalam kurungan ke nombor Model di bawah.',
    ml: "Loading...",
    no: "Loading...",
    fa: 'تلفن Blackberry شما. ما به جزئیاتی نیاز داریم که مدل آن را مشخص کند. به تنظیمات > درباره تلفن (قبلاً «درباره دستگاه») بروید. مدل NAME و (NUMBER) در یک خط به نام "Model" ترکیب می شوند. نام را قبل از پرانتز در نام مدل زیر کپی کنید. حروف و اعداد داخل پرانتز را در شماره مدل زیر کپی کنید.',
    pl: "Loading...",
    pt: "Loading...",
    ro: "Loading...",
    ru: "Loading...",
    sr: "Loading...",
    es: 'SU TELÉFONO Blackberry. Necesitamos detalles que especifiquen el modelo. Vaya a Ajustes > Acerca del teléfono (anteriormente "Acerca del dispositivo"). El NOMBRE y el NÚMERO del modelo se combinan en una sola línea llamada "Modelo". Copie el nombre antes del paréntesis en "Nombre del modelo" (abajo). Copie las letras y los números dentro del paréntesis en "Número de modelo" (abajo).',
    sw: "Loading...",
    sv: "Loading...",
    tl: 'IYONG Blackberry PHONE. Kailangan namin ng mga detalye na tumutukoy sa modelo nito. Pumunta sa Mga Setting > Tungkol sa telepono (dating "Tungkol sa device"). Ang modelong NAME at (NUMBER) ay pinagsama sa isang linya na tinatawag na "Modelo". Kopyahin ang pangalan bago ang mga panaklong sa Pangalan ng modelo sa ibaba. Kopyahin ang mga titik at numero sa loob ng panaklong sa Numero ng modelo sa ibaba.',
