    "zh-TW": "Loading...",
    hr: "VAŠE Linux RAČUNALO. Potrebni su nam detalji koji određuju njegovu marku i model. Model se nalazi na različite načine na različitim Linux sustavima. Jedan je pogledati datoteku\n/sys/devices/virtual/dmi/id/naziv_proizvoda\nKopirajte naziv modela i broj u odgovarajuća polja u nastavku.",
    cs: "Loading...",
    da: "DIN Linux COMPUTER. Vi har brug for detaljer, der specificerer dets mærke og model. Modellen findes på forskellige måder på forskellige Linux-systemer. Den ene er at se på filen\n/sys/devices/virtual/dmi/id/product_name\nKopier modelnavnet og -nummeret til de tilsvarende felter nedenfor.",
    nl: "Loading...",
    fi: "Linux-TIETOKONEESI. Tarvitsemme sen merkin ja mallin tarkempia tietoja. Malli löytyy eri tavoin eri Linux-järjestelmissä. Yksi on katsoa tiedostoa\n/sys/devices/virtual/dmi/id/product_name\nKopioi mallin nimi ja numero alla oleviin vastaaviin kenttiin.",
    fr: "Loading...",
    de: "IHR Linux-COMPUTER. Wir benötigen Angaben zu Marke und Modell. Das Modell lässt sich auf verschiedenen Linux-Systemen unterschiedlich ermitteln. Eine Möglichkeit ist die Datei\n/sys/devices/virtual/dmi/id/product_name. Kopieren Sie Modellname und -nummer in die entsprechenden Felder unten.",
    el: "Loading...",
    he: "Loading...",
    hi: "आपका Linux कंप्यूटर। हमें इसके ब्रांड और मॉडल के बारे में विस्तृत जानकारी चाहिए। अलग-अलग Linux सिस्टम पर मॉडल अलग-अलग तरीकों से पाया जा सकता है। एक तरीका यह है कि आप फ़ाइल देखें\n/sys/devices/virtual/dmi/id/product_name\nमॉडल का नाम और नंबर नीचे दिए गए संबंधित फ़ील्ड में कॉपी करें।",
    hu: "Loading...",
    is: "Linux tölvan þín. Við þurfum upplýsingar um vörumerki þess og gerð. Líkanið er að finna á mismunandi vegu á mismunandi Linux kerfum. Eitt er að skoða skrána\n/sys/devices/virtual/dmi/id/product_name\nAfritaðu heiti líkans og númer í samsvarandi reiti hér að neðan.",
    id: "Loading...",
    it: "IL TUO COMPUTER Linux. Abbiamo bisogno di dettagli che ne specifichino marca e modello. Il modello si trova in modi diversi sui diversi sistemi Linux. Uno è cercare nel file\n/sys/devices/virtual/dmi/id/product_name\nCopia il nome e il numero del modello nei campi corrispondenti qui sotto.",
