    ro: "Loading...",
    ru: "РУКОВОДСТВО ПО УСТАНОВКЕ ПРИНТЕРА ЭТИКЕТОК DYMO\nВыполните следующие шаги, чтобы помочь этому исследованию напечатать этикетки на вашем DYMO LabelWriter 550.\n① Установка программного обеспечения DYMO\nЗагрузите и установите последнюю версию программного обеспечения DYMO для вашей ОС с сайта поддержки DYMO:\nhttps://www.dymo.com/support?cfid=user-guide\nВ браузере перейдите по адресу:\nDYMO.WebApi.Mac.Host:\nУбедитесь, что DYMO.WebApi.Mac.Host запущен.\n② Настройте браузер\n▶ Chrome\nПерейдите по адресу:\nchrome://flags\nНайдите TLS в строке поиска.\nВ результатах проверки TLS отключите:\n⚬ Ранние данные TLS 1.3\n⚬ Постквантовое согласование ключей TLS 1.3\n⚬ Использовать ML-KEM в TLS 1.3\n⚬ Пропустить клиентские сертификаты TLS, если режим учётных данных запрещён.\n\nНажмите кнопку «ПЕРЕЗАПУСК» внизу.\n\n▶ Firefox\nПерейдите в «Настройки» → «Поиск сертификата».\n\nСнимите флажок «Разрешить Firefox автоматически доверять сторонним корневым сертификатам...».\n\nПерезапустите Firefox.\n\n▶ Safari\nПерейдите по адресу:\nhttps://127.0.0.1:41951/DYMO/DLS/Printing/StatusConnected\nПри появлении запроса выберите\n«Показать подробности» → «Посетить этот веб-сайт»,\nчтобы обойти предупреждение системы безопасности.\n\n③ Печать этикетки\nУбедитесь, что DYMO.WebApi.Mac.Host запущен.\nНажмите кнопку «ПЕЧАТЬ ЭТИКЕТКИ» на этой странице.\n\nПРОБЛЕМА: Если печать по-прежнему не удаётся, убедитесь, что DYMO.WebApi.Mac.Host запущен, или обратитесь в официальную службу поддержки DYMO.\nВНИМАНИЕ: После печати снова включите все настройки безопасности, чтобы обеспечить максимальную защиту вашего браузера.",
