    sw: 'MWONGOZO WA KUFUNGA KIPICHA CHA DYMO LABEL\nFuata hatua hizi ili kusaidia utafiti huu kuchapisha lebo kwenye DYMO LabelWriter 550 yako.\n① Sakinisha Programu ya DYMO\nPakua na Usakinishe programu ya hivi punde zaidi ya DYMO ya Mfumo wako wa Uendeshaji kutoka kwa tovuti ya usaidizi ya DYMO:\nhttps://www.dymo.com/support?cfid=user-guide\nKatika kivinjari chako, nenda kwa:\nDYMO.WebApi.Mac.Host:\nHakikisha kuwa DYMO.WebApi.Mac.Host inaendeshwa.\n② Sanidi Kivinjari Chako\n▶ Chrome\nNenda kwa:\nchrome://bendera\nTafuta TLS kwenye upau wa kutafutia.\nKutoka kwa matokeo ya TLS, zima:\n⚬ TLS 1.3 Data ya Mapema\n⚬ TLS 1.3 makubaliano muhimu ya baada ya quantum\n⚬ Tumia ML-KEM katika TLS 1.3\n⚬ Ondoa vyeti vya mteja wa TLS ikiwa hali ya kitambulisho hairuhusu.\nBofya UPYA UPYA chini.\n▶ Firefox\nNenda kwa Mipangilio → Tafuta Cheti.\nBatilisha uteuzi wa “Ruhusu Firefox iamini kiotomatiki cheti cha mizizi cha wahusika wengine...”\nAnzisha tena Firefox.\n▶ Safari\nNenda kwa:\nhttps://127.0.0.1:41951/DYMO/DLS/Printing/StatusConnected\nUkiulizwa, chagua\n"Onyesha Maelezo" → "tembelea tovuti hii"\nkukwepa onyo la usalama.\n③ Chapisha Lebo\nHakikisha kuwa DYMO.WebApi.Mac.Host inaendeshwa.\nBonyeza kitufe cha PRINT LABEL kwenye ukurasa huu.\n\nTATIZO: Ikiwa bado huwezi kuchapisha, thibitisha kuwa DYMO.WebApi.Mac.Host inaendesha au wasiliana na usaidizi rasmi wa DYMO.\nTAHADHARI: Washa upya mipangilio yoyote ya usalama baada ya uchapishaji ili kudumisha ulinzi wa juu zaidi kwenye kivinjari chako.',
    sv: 'INSTALLATIONSGUIDE FÖR DYMO ETIKETTSSKRIVARE\nFölj dessa steg för att hjälpa denna studie att skriva ut etiketter på din DYMO LabelWriter 550.\n① Installera DYMO-programvaran\nLadda ner och installera den senaste DYMO-mjukvaran för ditt operativsystem från DYMOs supportwebbplats:\nhttps://www.dymo.com/support?cfid=user-guide\nI din webbläsare går du till:\nDYMO.WebApi.Mac.Host:\nSe till att DYMO.WebApi.Mac.Host körs.\n② Konfigurera din webbläsare\n▶ Krom\nGå till:\nchrome://flags\nSök efter TLS i sökfältet.\nFrån TLS-resultaten, inaktivera:\n⚬ TLS 1.3 Tidiga data\n⚬ TLS 1.3 post-kvantnyckelavtal\n⚬ Använd ML-KEM i TLS 1.3\n⚬ Utelämna TLS-klientcertifikat om autentiseringsläget inte tillåter.\nKlicka på RELAUNCH längst ned.\n▶ Firefox\nGå till Inställningar → Sök efter certifikat.\nAvmarkera "Tillåt Firefox att automatiskt lita på rotcertifikat från tredje part..."\nStarta om Firefox.\n▶ Safari\nGå till:\nhttps://127.0.0.1:41951/DYMO/DLS/Printing/StatusConnected\nOm du uppmanas, välj\n"Visa detaljer" → "besök denna webbplats"\nför att kringgå säkerhetsvarningen.\n③ Skriv ut en etikett\nSe till att DYMO.WebApi.Mac.Host körs.\nTryck på knappen PRINT LABEL på den här sidan.\n\nPROBLEM: Om du fortfarande inte kan skriva ut, bekräfta att DYMO.WebApi.Mac.Host körs eller konsultera den officiella DYMO-supporten.\nVARNING: Återaktivera alla säkerhetsinställningar efter utskrift för att bibehålla det högsta skyddet på din webbläsare.',
