    ml: "1. ഈ പഠനത്തിനായി നിങ്ങൾ ഉപയോഗിക്കാൻ ആഗ്രഹിക്കുന്ന സ്ക്രീനിലേക്ക് ഈ വിൻഡോ വലിച്ചിടുക. \n2. മിക്കവാറും ആ സ്‌ക്രീനിൽ ഉണ്ടായാൽ മതി.\n2. തുടർന്ന് PROCEED ക്ലിക്ക് ചെയ്യുക അല്ലെങ്കിൽ RETURN അമർത്തുക.",
    no: "1. Dra dette vinduet til hvilken skjerm du vil bruke for denne studien. \n2. Det er nok å være mest på den skjermen.\n2. Klikk deretter FORTSETT eller trykk RETURN.",
    fa: "Loading...",
    pl: "1. Przeciągnij to okno na ekran, którego chcesz użyć do tego badania.\n2. Wystarczy, że będziesz prawie cały czas na tym ekranie.\n2. Następnie kliknij KONTYNUUJ lub naciśnij RETURN.",
    pt: "1. Arraste esta janela para a tela que você deseja usar para este estudo.\n2. Basta permanecer a maior parte do tempo nessa tela.\n2. Em seguida, clique em PROSSEGUIR ou pressione RETURN.",
    ro: "1. Vă rugăm să trageți această fereastră pe orice ecran pe care doriți să îl utilizați pentru acest studiu. \n2. Este suficient să fii mai ales pe acel ecran.\n2. Apoi faceți clic pe PROCEED sau apăsați RETURN.",
