    fi: "Loading...",
    fr: "1. Parfait ! Vous avez terminé la première des deux mesures.\n2. Penchez-vous en arrière pour recommencer.\n3. Penchez-vous à nouveau vers la webcam, jusqu'à ce que la distance entre la webcam et votre œil corresponde à la longueur de l'objet.\n4. Sans bouger la tête, retirez l'objet et appuyez sur RETOUR pour continuer.",
    de: "Loading...",
    el: "Loading...",
    he: "1. מעולה! השלמת את המדידה הראשונה מבין שתיים.\n2. הישענו אחורה להתחלה חדשה.\n3. שוב הישענו לעבר מצלמת האינטרנט, עד שהמרחק ממצלמת הרשת לעין שלכם יתאים לאורך האובייקט.\n4. מבלי להזיז את הראש, הסר את החפץ, ולחץ על RETURN כדי להמשיך.",
