    kn: "1. ಗ್ರೇಟ್! ನೀವು ಎರಡು ಅಳತೆಗಳಲ್ಲಿ ಮೊದಲನೆಯದನ್ನು ಪೂರ್ಣಗೊಳಿಸಿದ್ದೀರಿ.\n2. ಹೊಸ ಆರಂಭಕ್ಕಾಗಿ ಹಿಂದೆ ಸರಿಯಿರಿ.\n3. ವೆಬ್‌ಕ್ಯಾಮ್‌ನ ಕಡೆಗೆ ಮತ್ತೊಮ್ಮೆ ಒಲವು ತೋರಿ, ವೆಬ್‌ಕ್ಯಾಮ್‌ನಿಂದ ನಿಮ್ಮ ಕಣ್ಣಿಗೆ ಇರುವ ಅಂತರವು ಆಬ್ಜೆಕ್ಟ್‌ನ ಉದ್ದಕ್ಕೆ ಹೊಂದಿಕೆಯಾಗುವವರೆಗೆ.\n4. ನಿಮ್ಮ ತಲೆಯನ್ನು ಚಲಿಸದೆಯೇ, ವಸ್ತುವನ್ನು ತೆಗೆದುಹಾಕಿ ಮತ್ತು ಮುಂದುವರಿಸಲು RETURN ಒತ್ತಿರಿ.",
