    lt: "Loading...",
    ms: "1. Hebat! Anda telah melengkapkan yang pertama daripada dua ukuran.\n2. Bersandar ke belakang untuk permulaan yang baru.\n3. Sekali lagi condong ke arah kamera web, sehingga jarak dari kamera web ke mata anda sepadan dengan panjang objek.\n4. Tanpa menggerakkan kepala anda, keluarkan objek, dan tekan RETURN untuk meneruskan.",
