    fi: "1. Kallista näyttöäsi keskittääksesi silmäsi videon esikatselussa →\n2. Jos verkkokamerasi on liikuteltava, aseta se yläreunaan keskelle ja keskitä silmäsi uudelleen.\n3. Useimmissa kameroissa on valkoinen tai vihreä valo.\nOnko kamerasi nyt ylhäällä keskellä?\nO Kyllä O Ei O En tiedä (Kaikki vastaukset ovat kunnossa – tämä ei vaikuta osallistumiseen.)",
    fr: "1. Inclinez votre écran pour centrer votre regard dans l'aperçu vidéo →\n2. Si votre webcam est mobile, placez-la en haut au centre et recentrez votre regard.\n3. La plupart des caméras ont une lumière blanche ou verte.\nVotre caméra est-elle maintenant en haut au centre ?\nO Oui O Non O Je ne sais pas (Toutes les réponses sont correctes, cela n'affectera pas votre participation.)",
    de: "1. Neigen Sie Ihren Bildschirm, um Ihre Augen in der Videovorschau zu zentrieren. →\n2. Wenn Ihre Webcam beweglich ist, platzieren Sie sie oben in der Mitte und zentrieren Sie Ihre Augen neu.\n3. Die meisten Kameras haben ein weißes oder grünes Licht.\nIst Ihre Kamera jetzt oben in der Mitte?\nO Ja O Nein O Weiß nicht (Alle Antworten sind in Ordnung – dies hat keinen Einfluss auf Ihre Teilnahme.)",
    el: "1. Γείρετε την οθόνη σας για να κεντράρετε τα μάτια σας στην προεπισκόπηση βίντεο →\n2. Εάν η web κάμερα σας είναι κινητή, τοποθετήστε την στο επάνω κέντρο και κεντράρετε ξανά τα μάτια σας.\n3. Οι περισσότερες κάμερες έχουν λευκό ή πράσινο φως.\nΕίναι η κάμερά σας τώρα στο κέντρο της κορυφής;\nO Ναι O Όχι O Δεν ξέρω (Όλες οι απαντήσεις είναι καλές—αυτό δεν θα επηρεάσει τη συμμετοχή σας.)",
    he: "Loading...",
    hi: "Loading...",
    hu: "1. Döntse meg a képernyőt, hogy szeme középre kerüljön a videó előnézetében →\n2. Ha a webkamerája mozgatható, helyezze a tetejére középre, és állítsa újra a szemébe.\n3. A legtöbb kamera fehér vagy zöld lámpával rendelkezik.\nA kamerája most fent van középen?\nO Igen O Nem O Nem tudom (Minden válasz rendben van – ez nincs hatással a részvételére.)",
    is: "1. Hallaðu skjánum til að miðja augun í forskoðun myndbandsins →\n2. Ef vefmyndavélin þín er hreyfanleg skaltu setja hana efst í miðjuna og miðja augun aftur.\n3. Flestar myndavélar eru með hvítu eða grænu ljósi.\nEr myndavélin þín núna efst í miðjunni?\nO Já O Nei O Veit ekki (Öll svör eru í lagi - þetta hefur ekki áhrif á þátttöku þína.)",
    id: "Loading...",
    it: "1. Inclina lo schermo per centrare gli occhi nell'anteprima del video →\n2. Se la webcam è mobile, posizionala al centro in alto e centra nuovamente gli occhi.\n3. La maggior parte delle webcam ha una luce bianca o verde.\nLa tua webcam è ora al centro in alto?\n\nO Sì O No O Non so (Tutte le risposte sono valide, questo non influirà sulla tua partecipazione.)",
