    lt: "1. Raskite savo internetinę kamerą, dažniausiai viršuje centre, su balta arba žalia šviesa.\n2. Pakelkite objektą ir vieną galą padėkite prie internetinės kameros, o kitą – prie akies.\n3. Pasilenkite, kol jūsų akių atstumas nuo internetinės kameros atitiks objekto ilgį.\n4. Laikykite ramiai, nuimkite objektą, kad fotoaparatas jus matytų, tada bakstelėkite TARPAS, kad pamatytumėte.",
    ms: "1. Cari kamera web anda, biasanya di tengah atas, dengan lampu putih atau hijau.\n2. Angkat objek dan letakkan satu hujung berhampiran kamera web dan satu lagi dekat mata anda.\n3. Condongkan badan sehingga jarak mata anda dari kamera web sepadan dengan panjang objek.\n4. Tahan diam, keluarkan objek supaya kamera dapat melihat anda, kemudian ketik RUANG untuk mengukur.",
    ml: "Loading...",
    no: "Loading...",
