    sv: "Loading...",
    tl: "1. Hanapin ang iyong webcam, karaniwang nasa itaas na gitna, na may puti o berdeng ilaw.\n2. Itaas ang bagay at ilagay ang isang dulo malapit sa webcam at ang isa naman malapit sa iyong mata.\n3. Sumandal hanggang sa ang distansya ng iyong mata mula sa webcam ay tumugma sa haba ng bagay.\n4. Maghintay, alisin ang bagay para makita ka ng camera, pagkatapos ay i-tap ang SPACE para sukatin.",
