    fr: "Loading...",
    de: "Loading...",
    el: "Loading...",
    he: "תפוס את הצלב! אנחנו צריכים את עזרתכם. גשש העיניים זקוק לאימון נוסף. כפי שמוצג על ידי החץ, כאשר לחצת, הגשש חשב שהמבט שלך רחוק מהצלב. אנא לחץ על הצלב בכל עמדה חדשה. זה משחק. לתפוס את הצלב!",
    hi: "क्रॉस पकड़ो! हमें आपकी मदद चाहिए। आई ट्रैकर को और प्रशिक्षण की ज़रूरत है। जैसा कि तीर से पता चलता है, जब आपने क्लिक किया, तो ट्रैकर को लगा कि आपकी नज़र क्रॉस से दूर है। कृपया हर नई जगह पर क्रॉस पर क्लिक करें। यह एक खेल है। क्रॉस पकड़ो!",
    hu: "Loading...",
    is: "Loading...",
    id: "TANGKAP SALIB! Kami butuh bantuanmu. Pelacak mata perlu latihan lebih lanjut. Seperti yang ditunjukkan panah, saat kamu mengklik, pelacak mengira pandanganmu jauh dari salib. Silakan klik salib di setiap posisi baru. Ini permainan. Tangkap salibnya!",
    it: "Loading...",
    ja: "Loading...",
    kn: "ಕ್ರಾಸ್ ಕ್ಯಾಚ್! ನಮಗೆ ನಿಮ್ಮ ಸಹಾಯ ಬೇಕು. ಕಣ್ಣಿನ ಟ್ರ್ಯಾಕರ್‌ಗೆ ಹೆಚ್ಚಿನ ತರಬೇತಿಯ ಅಗತ್ಯವಿದೆ. ಬಾಣದಿಂದ ತೋರಿಸಿರುವಂತೆ, ನೀವು ಕ್ಲಿಕ್ ಮಾಡಿದಾಗ, ನಿಮ್ಮ ನೋಟವು ಅಡ್ಡದಿಂದ ದೂರದಲ್ಲಿದೆ ಎಂದು ಟ್ರ್ಯಾಕರ್ ಭಾವಿಸಿದೆ. ದಯವಿಟ್ಟು ಪ್ರತಿ ಹೊಸ ಸ್ಥಾನದಲ್ಲಿ ಕ್ರಾಸ್ ಅನ್ನು ಕ್ಲಿಕ್ ಮಾಡಿ. ಅದೊಂದು ಆಟ. ಶಿಲುಬೆಯನ್ನು ಹಿಡಿಯಿರಿ!",
    ko: "십자가를 잡아라! 도움이 필요해요. 시선 추적기에 훈련이 더 필요합니다. 화살표에서 알 수 있듯이, 클릭했을 때 시선 추적기는 시선이 십자가에서 멀리 떨어져 있다고 판단했습니다. 새로운 위치에서 십자가를 클릭해 주세요. 게임이에요. 십자가를 잡아라!",
    lt: "PAGAUKITE KRYŽIUS! Mums reikia jūsų pagalbos. Akių stebėjimui reikia daugiau treniruočių. Kaip rodo rodyklė, kai spustelėjote, seklys manė, kad jūsų žvilgsnis buvo toli nuo kryžiaus. Kiekvienoje naujoje vietoje spustelėkite kryžių. Tai žaidimas. Pagauk kryžių!",
    ms: "TANGKAP SALIB! Kami memerlukan bantuan anda. Penjejak mata memerlukan lebih banyak latihan. Seperti yang ditunjukkan oleh anak panah, apabila anda mengklik, penjejak menganggap pandangan anda jauh dari salib. Sila klik tanda pangkah pada setiap kedudukan baharu. Ia adalah permainan. Tangkap salib!",
