    lt: "Loading...",
    ms: "Mengambil bahagian dalam kajian ini membolehkan anda membuat sumbangan bermakna kepada kemajuan penyelidikan pendengaran dalam talian dengan menyediakan data penting tentang pelbagai jenis mikrofon telefon pintar dan pembesar suara komputer. Penyelidikan ini bertujuan untuk mencipta perpustakaan terperinci profil peranti yang akan meningkatkan ketepatan ujian pendengaran yang dijalankan dalam talian.  Skim ini bergantung pada pemadanan mikrofon telefon pengguna dengan mikrofon yang ditentukur makmal. Setiap model mempunyai mikrofon yang berbeza, jadi adalah penting untuk menentukan modelnya. \nMemahami bahawa privasi adalah keutamaan, sila yakin bahawa tinjauan ini hanya mengekalkan nombor model telefon dan komputer. Nombor model ini tidak dipautkan kepada sebarang maklumat peribadi dan tidak mengenal pasti anda. ",
    ml: "വൈവിധ്യമാർന്ന സ്മാർട്ട്‌ഫോൺ മൈക്രോഫോണുകളെയും കമ്പ്യൂട്ടർ സ്പീക്കറുകളെയും കുറിച്ചുള്ള അവശ്യ ഡാറ്റ നൽകിക്കൊണ്ട് ഓൺലൈൻ ശ്രവണ ഗവേഷണത്തിൻ്റെ പുരോഗതിക്ക് അർത്ഥവത്തായ സംഭാവന നൽകാൻ ഈ പഠനത്തിൽ പങ്കെടുക്കുന്നത് നിങ്ങളെ അനുവദിക്കുന്നു. ഓൺലൈനിൽ നടത്തുന്ന ശ്രവണ പരിശോധനകളുടെ കൃത്യത വർദ്ധിപ്പിക്കുന്ന ഉപകരണ പ്രൊഫൈലുകളുടെ ഒരു വിശദമായ ലൈബ്രറി സൃഷ്ടിക്കാൻ ഈ ഗവേഷണം ലക്ഷ്യമിടുന്നു.  ലാബ് കാലിബ്രേറ്റ് ചെയ്ത മൈക്രോഫോണുമായി ഉപയോക്താവിൻ്റെ ഫോൺ മൈക്രോഫോണുമായി പൊരുത്തപ്പെടുന്നതിനെയാണ് സ്കീം ആശ്രയിക്കുന്നത്. ഓരോ മോഡലിനും വ്യത്യസ്‌തമായ മൈക്രോഫോൺ ഉണ്ട്, അതിനാൽ മോഡൽ വ്യക്തമാക്കേണ്ടത് നിർണായകമാണ്. \nസ്വകാര്യതയ്ക്ക് മുൻഗണനയുണ്ടെന്ന് മനസ്സിലാക്കി, ഫോണുകളുടെയും കമ്പ്യൂട്ടറുകളുടെയും മോഡൽ നമ്പറുകൾ മാത്രമേ ഈ സർവേയിൽ സൂക്ഷിക്കുന്നുള്ളൂവെന്ന് ദയവായി ഉറപ്പാക്കുക. ഈ മോഡൽ നമ്പറുകൾ ഏതെങ്കിലും വ്യക്തിഗത വിവരങ്ങളുമായി ലിങ്ക് ചെയ്‌തിട്ടില്ല, മാത്രമല്ല നിങ്ങളെ തിരിച്ചറിയുന്നില്ല. ",
    no: "Deltakelse i denne studien lar deg gi et meningsfullt bidrag til fremme av nettbasert hørselsforskning ved å gi viktige data om det mangfoldige utvalget av smarttelefonmikrofoner og datamaskinhøyttalere. Denne forskningen tar sikte på å lage et detaljert bibliotek med enhetsprofiler som vil forbedre nøyaktigheten til hørselstester utført på nettet.  Opplegget avhenger av å matche brukerens telefonmikrofon med en laboratoriekalibrert mikrofon. Hver modell har sin egen mikrofon, så det er avgjørende å spesifisere modellen. \nForstå at personvern er en prioritet, kan du være sikker på at denne undersøkelsen kun beholder modellnumrene til telefoner og datamaskiner. Disse modellnumrene er ikke knyttet til noen personlig informasjon og identifiserer deg ikke. ",
    fa: "Loading...",
    pl: "Loading...",
    pt: "Participar deste estudo permite que você contribua significativamente para o avanço da pesquisa auditiva online, fornecendo dados essenciais sobre a ampla gama de microfones de smartphones e alto-falantes de computador. Esta pesquisa visa criar uma biblioteca detalhada de perfis de dispositivos que aumentará a precisão dos testes auditivos realizados online. O esquema depende da correspondência do microfone do telefone do usuário com um microfone calibrado em laboratório. Cada modelo possui um microfone diferente, por isso é crucial especificá-lo.\nCompreendendo que a privacidade é uma prioridade, tenha certeza de que esta pesquisa retém apenas os números dos modelos de telefones e computadores. Esses números de modelo não estão vinculados a nenhuma informação pessoal e não o identificam.",
    ro: "Loading...",
    ru: "Loading...",
    sr: "Loading...",
    es: "Participar en este estudio le permite contribuir significativamente al avance de la investigación auditiva en línea, proporcionando datos esenciales sobre la diversa gama de micrófonos para teléfonos inteligentes y altavoces de computadora. Esta investigación tiene como objetivo crear una biblioteca detallada de perfiles de dispositivos que mejorará la precisión de las pruebas de audición realizadas en línea. El esquema se basa en la compatibilidad del micrófono del teléfono del usuario con un micrófono calibrado en laboratorio. Cada modelo tiene un micrófono diferente, por lo que es crucial especificar el modelo.\n\nEntendiendo que la privacidad es una prioridad, le aseguramos que esta encuesta solo conserva los números de modelo de teléfonos y computadoras. Estos números de modelo no están vinculados a ninguna información personal y no lo identifican.",
    sw: "Kushiriki katika utafiti huu kunakuruhusu kutoa mchango wa maana katika kuendeleza utafiti wa usikilizaji mtandaoni kwa kutoa data muhimu kuhusu aina mbalimbali za maikrofoni mahiri na spika za kompyuta. Utafiti huu unalenga kuunda maktaba ya kina ya wasifu wa kifaa ambayo itaimarisha usahihi wa majaribio ya kusikia yanayofanywa mtandaoni.  Mpango huo unategemea kulinganisha maikrofoni ya simu ya mtumiaji na maikrofoni iliyosawazishwa na maabara. Kila modeli ina maikrofoni tofauti, kwa hivyo ni muhimu kutaja mfano. \nKwa kuelewa kuwa faragha ni kipaumbele, tafadhali hakikisha kuwa utafiti huu unabakisha nambari za mfano za simu na kompyuta pekee. Nambari hizi za mfano hazijaunganishwa na maelezo yoyote ya kibinafsi na hazikutambulishi. ",
