    el: "ΣΥΝΔΕΣΗ ΣΤΟ ΔΙΑΔΙΚΤΥΟ\nΤο τηλέφωνο που δοκιμάζετε είναι ήδη συνδεδεμένο στο διαδίκτυο;\n1. ΝΑΙ, στη συνέχεια κάντε κλικ στο OK παρακάτω για να συνεχίσετε.\n2. 📶 CELL SERVICE: Εάν η υπηρεσία κινητής τηλεφωνίας του τηλεφώνου συνδέεται στο διαδίκτυο, κάντε κλικ στο OK.\n3. 🛜 WIFI: Συνδέστε το τηλέφωνο στο διαδίκτυο μέσω Wi-Fi και κάντε κλικ στο OK.\n4. 📅 ΡΥΘΜΙΣΗ ΩΡΑΣ ΚΑΙ ΗΜΕΡΟΜΗΝΙΑΣ: Ένα νέο τηλέφωνο ή ένα παλιό τηλέφωνο που έχει γίνει επαναφορά, δεν έχει λογαριασμό κινητής τηλεφωνίας και λάθος ημερομηνία. Μόλις ορίσετε την ώρα και την ημερομηνία, θα λειτουργεί με hotspot/tethering, όπως εξηγείται στη συνέχεια.\n5. 📱📱ΣΗΜΕΙΟ: Εάν το τηλέφωνο δοκιμής δεν είναι το προσωπικό σας τηλέφωνο και το προσωπικό σας τηλέφωνο διαθέτει internet, τα δύο τηλέφωνα μπορούν να έχουν κοινή πρόσβαση στο Διαδίκτυο. Συνδέστε τα τηλέφωνα μεταξύ τους μέσω Wi-Fi, Bluetooth ή USB:\n    * 📱🛜📱 Wi-Fi Hotspot: Εάν το προσωπικό σας τηλέφωνο είναι συνδεδεμένο στο διαδίκτυο μέσω υπηρεσίας κινητής τηλεφωνίας, μπορεί να παρέχει ένα σημείο πρόσβασης Wi-Fi στο τηλέφωνο δοκιμής. Μόλις συνδεθείτε, κάντε κλικ στο OK παρακάτω.\n    * 📱>ᛒ📱 Bluetooth Tethering: Εάν το προσωπικό σας τηλέφωνο χρησιμοποιεί Wi-Fi για πρόσβαση στο Διαδίκτυο, μπορεί να μοιραστεί την πρόσβαση στο Διαδίκτυο μέσω Bluetooth. Ενεργοποιήστε το Bluetooth (σε iPhone) ή τη σύνδεση Bluetooth (σε Android) και στα δύο τηλέφωνα, πραγματοποιήστε σύζευξη μέσω Bluetooth και κάντε κλικ στο OK παρακάτω.\n    * 📱 — Σήμερα, τα περισσότερα τηλέφωνα χρησιμοποιούν υποδοχή USB-C, αλλά το iPhone 14 και παλαιότερα χρησιμοποιούν την υποδοχή Lightning. Συνδέστε τα τηλέφωνα μέσω του κατάλληλου καλωδίου και κάντε κλικ στο OK παρακάτω.\n6. ❌ ΟΧΙ ΔΙΑΔΙΚΤΥΟ: Εάν καμία από αυτές τις επιλογές δεν είναι διαθέσιμη, κάντε πρώτα κλικ στο OK παρακάτω και, στη συνέχεια, «❌ Όλες οι προσπάθειες σύνδεσης απέτυχαν».",
