    hi: "इंटरनेट से कनेक्ट करना\nक्या आप जिस फ़ोन का परीक्षण कर रहे हैं, वह पहले से ही इंटरनेट से जुड़ा है?\n1. हाँ, फिर आगे बढ़ने के लिए नीचे दिए गए OK पर क्लिक करें।\n2. 📶 मोबाइल सेवा: अगर फ़ोन की मोबाइल सेवा इंटरनेट से कनेक्ट होती है, तो OK पर क्लिक करें।\n3. 🛜 वाई-फ़ाई: फ़ोन को वाई-फ़ाई के ज़रिए इंटरनेट से कनेक्ट करें और OK पर क्लिक करें।\n4. 📅 समय और तारीख सेट करें: एक नए फ़ोन, या एक पुराने फ़ोन जिसे रीसेट किया गया है, में कोई मोबाइल सेवा खाता नहीं है और तारीख गलत है। एक बार जब आप समय और तारीख सेट कर लेते हैं, तो यह हॉटस्पॉट/टेथरिंग के साथ काम करेगा, जैसा कि आगे बताया गया है।\n5. 📱🔗📱हॉटस्पॉट: अगर परीक्षण किया जा रहा फ़ोन आपका निजी फ़ोन नहीं है, और आपके निजी फ़ोन में इंटरनेट है, तो दोनों फ़ोन इंटरनेट एक्सेस साझा कर सकते हैं। वाई-फ़ाई, ब्लूटूथ या यूएसबी के ज़रिए फ़ोन को एक-दूसरे से कनेक्ट करें:\n* 📱🛜📱 वाई-फ़ाई हॉटस्पॉट: अगर आपका निजी फ़ोन मोबाइल सेवा के ज़रिए इंटरनेट से जुड़ा है, तो वह टेस्ट किए गए फ़ोन को वाई-फ़ाई हॉटस्पॉट दे सकता है। कनेक्ट होने के बाद, नीचे दिए गए OK पर क्लिक करें।\n* 📱>ᛒ📱 ब्लूटूथ टेथरिंग: अगर आपका निजी फ़ोन इंटरनेट एक्सेस के लिए वाई-फ़ाई का इस्तेमाल कर रहा है, तो वह ब्लूटूथ के ज़रिए इंटरनेट एक्सेस शेयर कर सकता है। दोनों फ़ोन पर ब्लूटूथ (iPhone पर) या ब्लूटूथ टेथरिंग (Android पर) चालू करें, उन्हें ब्लूटूथ के ज़रिए पेयर करें और नीचे दिए गए OK पर क्लिक करें।\n* 📱—📱 यूएसबी टेथरिंग: अगर दोनों फ़ोन आईफ़ोन या एंड्रॉइड हैं, तो वे यूएसबी केबल के ज़रिए इंटरनेट एक्सेस शेयर कर सकते हैं, बशर्ते आपके पास सही केबल हो। आजकल, ज़्यादातर फ़ोन USB-C कनेक्टर का इस्तेमाल करते हैं, लेकिन iPhone 14 और उससे पहले के मॉडल लाइटनिंग कनेक्टर का इस्तेमाल करते हैं। फ़ोन को उपयुक्त केबल से कनेक्ट करें और नीचे दिए गए OK पर क्लिक करें।\n6. ❌ इंटरनेट नहीं: यदि इनमें से कोई भी विकल्प उपलब्ध नहीं है, तो पहले नीचे ओके पर क्लिक करें और फिर “❌ सभी कनेक्शन प्रयास विफल” पर क्लिक करें।",
    hu: "CSATLAKOZÁS AZ INTERNETHEZ\nA tesztelt telefon már csatlakozik az internethez?\n1. IGEN, majd kattintson az OK gombra lentebb a folytatáshoz.\n2. 📶 CELL SZOLGÁLTATÁS: Ha a telefon mobilszolgáltatása csatlakozik az internethez, kattintson az OK gombra.\n3. 🛜 WIFI: Csatlakoztassa a telefont az internethez Wi-Fi-n keresztül, majd kattintson az OK gombra.\n4. 📅 IDŐ ÉS DÁTUM BEÁLLÍTÁSA: Egy új vagy egy visszaállított régi telefonnak nincs mobilszolgáltatási fiókja, és rossz a dátum. Miután beállította az időt és a dátumot, a hotspottal/internetmegosztással fog működni, amint azt a következőkben ismertetjük.\n5. 📱🔗📱HOTSPOT: Ha a teszttelefon nem az Ön személyes telefonja, és a személyes telefonján van internet, a két telefon megoszthatja az internet-hozzáférést. Csatlakoztassa a telefonokat egymáshoz Wi-Fi-n, Bluetooth-on vagy USB-n keresztül:\n    * 📱🛜📱 Wi-Fi Hotspot: Ha személyes telefonja mobilszolgáltatáson keresztül csatlakozik az internethez, Wi-Fi hotspotot tud biztosítani a teszttelefonnak. A csatlakozás után kattintson az OK gombra lent.\n    * 📱>ᛒ📱 Bluetooth-internetmegosztás: Ha személyes telefonja Wi-Fi-t használ az internet-hozzáféréshez, meg tudja osztani az internet-hozzáférést Bluetooth-on keresztül. Mindkét telefonon engedélyezze a Bluetooth-t (iPhone-on) vagy a Bluetooth-megosztást (Androidon), párosítsa őket Bluetooth-on keresztül, majd kattintson az OK gombra lent.\n    * 📱—📱 USB-internetmegosztás: Ha mindkét telefon iPhone, vagy mindkét telefon Androidos, USB-kábelen keresztül megoszthatják az internet-hozzáférést, feltéve, hogy rendelkezik a megfelelő kábellel. Manapság a legtöbb telefon USB-C csatlakozót használ, de az iPhone 14 és korábbi modellek a Lightning csatlakozót. Csatlakoztassa a telefonokat a megfelelő kábellel, majd kattintson az OK gombra lent.\n6. ❌ NINCS INTERNET: Ha ezen opciók egyike sem elérhető, először kattintson az OK gombra lent, majd a „❌ Minden csatlakozási kísérlet sikertelen” gombra.",
