    kn: "Loading...",
    ko: "인터넷 연결\n테스트하려는 휴대폰이 이미 인터넷에 연결되어 있습니까?\n1. 예, 아래 '확인'을 클릭하여 계속하세요.\n2. 📶 셀룰러 서비스: 휴대폰의 셀룰러 서비스가 인터넷에 연결되어 있으면 '확인'을 클릭하세요.\n3. 🛜 Wi-Fi: Wi-Fi를 통해 휴대폰을 인터넷에 연결하고 '확인'을 클릭하세요.\n4. 📅 시간 및 날짜 설정: 새 휴대폰이나 초기화된 기존 휴대폰은 셀룰러 서비스 계정이 없고 날짜가 잘못 설정되어 있습니다. 시간과 날짜를 설정하면 아래에 설명된 대로 핫스팟/테더링이 작동합니다.\n5. 📱🔗📱핫스팟: 테스트 휴대폰이 개인 휴대폰이 아니고 개인 휴대폰에 인터넷이 연결된 경우, 두 휴대폰이 인터넷 액세스를 공유할 수 있습니다. Wi-Fi, Bluetooth 또는 USB를 통해 휴대폰을 서로 연결하세요.\n* 📱🛜📱 Wi-Fi 핫스팟: 개인 휴대폰이 이동통신 서비스를 통해 인터넷에 연결된 경우, 테스트 휴대폰에 Wi-Fi 핫스팟을 제공할 수 있습니다. 연결되면 아래 '확인'을 클릭하세요.\n* 📱>ᛒ📱 Bluetooth 테더링: 개인 휴대폰에서 Wi-Fi를 사용하여 인터넷에 접속하는 경우, Bluetooth를 통해 인터넷 접속을 공유할 수 있습니다. 두 휴대폰 모두 Bluetooth(iPhone) 또는 Bluetooth 테더링(Android)을 활성화하고 Bluetooth를 통해 페어링한 후 아래 '확인'을 클릭하세요.\n* 📱—📱 USB 테더링: 두 휴대폰 모두 iPhone이거나 두 휴대폰 모두 Android인 경우, 적합한 케이블이 있다면 USB 케이블을 통해 인터넷 접속을 공유할 수 있습니다. 현재 대부분의 휴대폰은 USB-C 커넥터를 사용하지만, iPhone 14 이하 모델은 Lightning 커넥터를 사용합니다. 적합한 케이블을 사용하여 휴대폰을 연결하고 아래 '확인'을 클릭하세요.\n6. ❌ 인터넷 없음: 이러한 옵션을 사용할 수 없는 경우 먼저 아래의 확인을 클릭한 다음 \"❌ 모든 연결 시도가 실패했습니다\"를 클릭하세요.",
    lt: "PRISIJUNGIMAS PRIE INTERNETO\nAr telefonas, kurį bandote, jau prijungtas prie interneto?\n1. TAIP, tada toliau spustelėkite Gerai, kad tęstumėte.\n2. 📶 CELL SERVICE: jei telefono mobiliojo ryšio paslauga prisijungia prie interneto, spustelėkite Gerai.\n3. 🛜 WIFI: prijunkite telefoną prie interneto per Wi-Fi ir spustelėkite Gerai.\n4. 📅 NUSTATYTI LAIKĄ IR DATĄ: naujame telefone arba sename telefone, kuris buvo nustatytas iš naujo, nėra mobiliojo ryšio paslaugų paskyros ir neteisinga data. Kai nustatysite laiką ir datą, jis veiks su viešosios interneto prieigos tašku / modemu, kaip paaiškinta toliau.\n5. 📱🔗📱HOT TAŠKAS: jei bandomasis telefonas nėra jūsų asmeninis telefonas, o jūsų asmeniniame telefone yra internetas, abu telefonai gali bendrai naudotis interneto prieiga. Prijunkite telefonus vienas prie kito per Wi-Fi, Bluetooth arba USB:\n    * 📱🛜📱 „Wi-Fi“ viešosios interneto prieigos taškas: jei jūsų asmeninis telefonas yra prijungtas prie interneto per mobiliojo ryšio paslaugą, jis gali suteikti „Wi-Fi“ viešosios interneto prieigos tašką bandomajam telefonui. Kai prisijungsite, toliau spustelėkite Gerai.\n    * 📱>ᛒ📱 Bluetooth ryšys: jei jūsų asmeninis telefonas naudoja Wi-Fi interneto prieigai, jis gali bendrinti interneto prieigą per Bluetooth. Abiejuose telefonuose įgalinkite „Bluetooth“ (iPhone) arba „Bluetooth“ susiejimą (Android), susiekite juos per „Bluetooth“ ir toliau spustelėkite Gerai.\n    * 📱—📱 USB pririšimas: jei abu telefonai yra iPhone arba abu telefonai yra Android, jie gali bendrinti interneto prieigą per USB kabelį, jei turite tinkamą laidą. Šiandien dauguma telefonų naudoja USB-C jungtį, tačiau „iPhone 14“ ir ankstesniuose modeliuose naudojama „Lightning“ jungtis. Prijunkite telefonus atitinkamu kabeliu ir toliau spustelėkite Gerai.\n6. ❌ NĖRA INTERNETO: jei nėra nė vienos iš šių parinkčių, pirmiausia spustelėkite toliau esantį mygtuką Gerai, tada „❌ Visi bandymai prisijungti nepavyko“.",
