    sv: 'ANSLUTA TILL INTERNET\nÄr telefonen du testar redan ansluten till internet?\n1. JA, klicka sedan på OK nedan för att fortsätta.\n2. 📶 CELLTJÄNST: Om telefonens mobiltjänst ansluter till internet klickar du på OK.\n3. 🛜 WIFI: Anslut telefonen till internet via Wi-Fi och klicka på OK.\n4. 📅 STÄLL IN TID OCH DATUM: En ny telefon, eller en gammal telefon som har återställts, har inget mobiltjänstkonto och fel datum. När du har ställt in tid och datum kommer det att fungera med hotspot/tethering, som förklaras härnäst.\n5. 📱🔗📱HOTSPOT: Om testtelefonen inte är din personliga telefon, och din personliga telefon har internet, kan de två telefonerna dela internetåtkomst. Anslut telefonerna till varandra via Wi-Fi, Bluetooth eller USB:\n    * 📱🛜📱 Wi-Fi-hotspot: Om din personliga telefon är ansluten till internet via mobiltjänst kan den tillhandahålla en Wi-Fi-hotspot till testtelefonen. När du är ansluten klickar du på OK nedan.\n    * 📱>ᛒ📱 Bluetooth-internetdelning: Om din personliga telefon använder Wi-Fi för internetåtkomst kan den dela internetåtkomsten via Bluetooth. Aktivera Bluetooth (på iPhone) eller Bluetooth-internetdelning (på Android) på båda telefonerna, koppla ihop dem via Bluetooth och klicka på OK nedan.\n    * 📱—📱 USB-internetdelning: Om båda telefonerna är iPhones eller båda telefonerna är Androids kan de dela internetåtkomsten via en USB-kabel, förutsatt att du har rätt kabel. Idag använder de flesta telefoner en USB-C-kontakt, men iPhone 14 och tidigare använder Lightning-kontakten. Anslut telefonerna via lämplig kabel och klicka på OK nedan.\n6. ❌ INGET INTERNET: Om inget av dessa alternativ är tillgängliga, klicka först på OK nedan och sedan på "❌ Alla anslutningsförsök misslyckades".',
    tl: "PAGKUNEKTA SA INTERNET\nNakakonekta na ba sa internet ang teleponong sinusubok mo?\n1. OO, pagkatapos ay i-click ang OK sa ibaba upang magpatuloy.\n2. 📶 CELL SERVICE: Kung ang cell service ng telepono ay kumokonekta sa internet, i-click ang OK.\n3. 🛜 WIFI: Ikonekta ang telepono sa internet sa pamamagitan ng Wi-Fi at i-click ang OK.\n4. 📅 Itakda ang ORAS AT PETSA: Ang isang bagong telepono, o isang lumang telepono na na-reset, ay walang cell service account at maling petsa. Kapag naitakda mo na ang oras at petsa, gagana ito sa hotspot/tether, gaya ng ipinaliwanag sa susunod.\n5. 📱🔗📱HOTSPOT: Kung ang pansubok na telepono ay hindi ang iyong personal na telepono, at ang iyong personal na telepono ay may internet, ang dalawang telepono ay maaaring magbahagi ng internet access. Ikonekta ang mga telepono sa isa't isa sa pamamagitan ng Wi-Fi, Bluetooth, o USB:\n    * 📱🛜📱 Wi-Fi Hotspot: Kung nakakonekta ang iyong personal na telepono sa internet sa pamamagitan ng cell service, maaari itong magbigay ng Wi-Fi hotspot sa pansubok na telepono. Kapag nakakonekta na, i-click ang OK sa ibaba.\n    * 📱>ᛒ📱 Bluetooth Tethering: Kung ang iyong personal na telepono ay gumagamit ng Wi-Fi para sa internet access, maaari nitong ibahagi ang internet access sa pamamagitan ng Bluetooth. Paganahin ang Bluetooth (sa iPhone) o Bluetooth tethering (sa Android) sa parehong mga telepono, ipares ang mga ito sa pamamagitan ng Bluetooth, at i-click ang OK sa ibaba.\n    * 📱—📱 USB Tethering: Kung ang parehong mga telepono ay mga iPhone o ang parehong mga telepono ay mga Android, maaari nilang ibahagi ang internet access sa pamamagitan ng USB cable, basta't mayroon kang tamang cable. Ngayon, karamihan sa mga telepono ay gumagamit ng USB-C connector, ngunit ang iPhone 14 at mas maaga ay gumagamit ng Lightning connector. Ikonekta ang mga telepono sa pamamagitan ng naaangkop na cable at i-click ang OK sa ibaba.\n6. ❌ WALANG INTERNET: Kung wala sa mga opsyong ito ang available, i-click muna ang OK sa ibaba at pagkatapos ay “❌ Nabigo ang lahat ng pagtatangka sa koneksyon”.",
