    ml: 'അല്ലാത്തപക്ഷം:\n● നിങ്ങളുടെ ക്യാമറ QR കോഡ് തിരിച്ചറിയുന്നില്ലെങ്കിൽ, പകർത്തുക\nxxx\nനിങ്ങളുടെ ഫോൺ ബ്രൗസറിൽ കയറി ബ്രൗസറിൻ്റെ GO ബട്ടൺ ടാപ്പ് ചെയ്യുക. തുടർന്ന് ഈ പേജ് മുന്നോട്ട് പോകണം.\n● ഇല്ലെങ്കിൽ, LLL, വീണ്ടും ശ്രമിക്കുക.\n● പരാജയപ്പെട്ടാൽ, "❌ എല്ലാ കണക്ഷൻ ശ്രമങ്ങളും പരാജയപ്പെട്ടു" എന്ന ബട്ടൺ ക്ലിക്ക് ചെയ്യുക.\n● നിങ്ങളുടെ ഫോൺ കണക്റ്റ് ചെയ്യാതെ തന്നെ പങ്കെടുക്കാൻ നിങ്ങൾ ആഗ്രഹിക്കുന്നുവെങ്കിൽ, മുൻഗണന നൽകരുത് ബട്ടൺ ക്ലിക്ക് ചെയ്യുക.\n● അവസാനമായി, സ്‌മാർട്ട്‌ഫോൺ ലഭ്യമല്ലെങ്കിൽ, സ്‌മാർട്ട്‌ഫോൺ ഇല്ല ക്ലിക്ക് ചെയ്യുക.',
    no: 'NOE ANNET:\n● Hvis kameraet ditt ikke gjenkjenner QR-koden, er det bare å kopiere\nxxx\ninn i telefonens nettleser og trykk på nettleserens GO-knapp. Denne siden bør deretter gå videre.\n● Hvis ikke, så LLL, og prøv igjen.\n● Hvis det ikke er mulig, klikker du på knappen som heter "❌ ALLE TILKOBLINGSFORSØK MISLYKKES".\n● Hvis du ønsker å delta uten å koble til telefonen, klikker du på FORETRUKKE-knappen.\n● Til slutt, hvis ingen smarttelefon er tilgjengelig, klikker du INGEN SMARTPHONE.',
    fa: "Loading...",
    pl: "W PRZECIWNYM WYPADKU:\n● Jeśli aparat nie rozpoznaje kodu QR, po prostu skopiuj\nxxx\ndo przeglądarki telefonu i dotknij przycisku START. Ta strona powinna przejść dalej.\n● Jeśli nie, naciśnij przycisk LLL i spróbuj ponownie.\n● Jeśli to się nie uda, kliknij przycisk „❌ WSZYSTKIE PRÓBY POŁĄCZENIA NIEUDANE”.\n● Jeśli chcesz wziąć udział bez podłączania telefonu, kliknij przycisk „WOLĄĆ NIE”.\n● Na koniec, jeśli żaden smartfon nie jest dostępny, kliknij BRAK SMARTFONA.",
    pt: 'CASO CONTRÁRIO:\n● Se a sua câmera não reconhecer o código QR, basta copiar\nxxx\npara o navegador do seu celular e tocar no botão IR. Esta página deverá avançar.\n● Caso contrário, clique em LLL e tente novamente.\n● Caso contrário, clique no botão "❌ TODAS AS TENTATIVAS DE CONEXÃO FALHARAM".\n● Se quiser participar sem conectar o seu celular, clique no botão PREFERIR NÃO.\n● Por fim, se nenhum smartphone estiver disponível, clique em SEM SMARTPHONE.',
    ro: "Loading...",
    ru: "В ПРОТИВНОМ СЛУЧАЕ:\n● Если ваша камера не распознаёт QR-код, просто скопируйте\nxxx\nв браузер телефона и нажмите кнопку «GO» в нём. Страница должна открыться.\n● Если нет, нажмите LLL и повторите попытку.\n● Если это не помогло, нажмите кнопку «❌ ВСЕ ПОПЫТКИ ПОДКЛЮЧЕНИЯ НЕ УДАЛИСЬ».\n● Если вы хотите участвовать без подключения телефона, нажмите кнопку «PREFER NOT» (ПРЕДПОЧИТАТЬ НЕТ).\n● Наконец, если смартфон недоступен, нажмите «NO SMARTPHONE» (НЕТ СМАРТФОНА).",
    sr: "Loading...",
    es: 'DE LO CONTRARIO:\n● Si tu cámara no reconoce el código QR, simplemente copia\nxxx\nen el navegador de tu teléfono y pulsa el botón IR. Esta página debería avanzar.\n● Si no, pulsa LLL y vuelve a intentarlo.\n● Si no, pulsa el botón "❌ TODOS LOS INTENTOS DE CONEXIÓN FALLARON".\n● Si quieres participar sin conectar tu teléfono, pulsa el botón "NO PREFERIR".\n● Por último, si no tienes un smartphone disponible, pulsa SIN SMARTPHONE.',
    sw: 'VINGINEVYO:\n● Ikiwa kamera yako haitambui msimbo wa QR, nakili tu\nxxx\nkwenye kivinjari cha simu yako na uguse kitufe cha GO cha kivinjari. Ukurasa huu unapaswa kusonga mbele.\n● Ikiwa sivyo, basi LLL, na ujaribu tena.\n● Ikishindikana, bofya kitufe kiitwacho "❌ JARIBIO ZOTE ZA KUUNGANISHA ZIMETIMIA".\n● Iwapo ungependa kushiriki bila kuunganisha simu yako, bofya kitufe cha PREFER NOT.\n● Hatimaye, ikiwa hakuna simu mahiri inayopatikana, bofya NO SMARTPHONE.',
    sv: 'ANNAT:\n● Om din kamera inte känner igen QR-koden är det bara att kopiera\nxxx\ni din telefons webbläsare och tryck på webbläsarens GO-knapp. Den här sidan bör sedan avancera.\n● Om inte, LLL och försök igen.\n● Om det misslyckas klickar du på knappen som heter "❌ ALLA ANSLUTNINGSFÖRSÖK MISSLYCKAS".\n● Om du vill delta utan att ansluta din telefon, klicka på knappen FÖREDRA INTE.\n● Slutligen, om ingen smartphone är tillgänglig, klicka på NO SMARTPHONE.',
