    fi: "Loading...",
    fr: "Désolé, le code QR n'apparaît pas. Veuillez actualiser la page pour réessayer. Pour actualiser la page, appuyez sur l'icône d'actualisation ⟳ dans la barre d'adresse. Si le problème persiste, cliquez sur le bouton « CONNEXION PAR CODE QR » ci-dessous.",
