    he: 'showMeasuredSoundLevelBool הוא TRUE בתנאי אחד או יותר, ולכן יש צורך במיקרופון כדי לבצע מדידות אלו.\n1. חבר את מיקרופון ה-miniDSP UMIK-1 או 2 למחשב זה.\n2. בחר את המיקרופון הזה בחלון הקופץ של כניסת הקול למטה.\n3. בחר את שם דגם המיקרופון, UMIK-1 או 2.\n4. הזן את המספר הסידורי ולחץ על הלחצן FETCH PROFILE.\n5. הגדר מיקרופון\n א. פרש את שלושת רגלי החצובה עד הסוף. \n ב. תפס המיקרופון של החצובה נמצא על מסתובב. סובב את הקליפ עד הצד לאיזה צד שמגביר את הקצה הגבוה ביותר של הקליפ. \n ג. הכנס את המיקרופון לקליפס החצובה, מלמטה, עד שהקצה התחתון של המיקרופון ישתלב עם הקצה הנמוך ביותר של הקליפ. \n ד. כוונן את ההטיה כדי להפוך את המיקרופון לאנכי, מצביע עד לתקרה. \n ה. הנח את החצובה על השולחן בינך לבין המחשב שלך. סובב את החצובה כדי להביא את המיקרופון לצדך. \n ו. דחוף את החצובה לכיוון המחשב שלך (או כל מה שיש בו את הרמקולים) עד ששתי הרגליים הרחוקות של החצובה כמעט נוגעות בה, והרגל השלישית קרובה אליך.\n6. אפשר שימוש במיקרופון. אם חלון קופץ מבקש רשות להשתמש במיקרופון, לחץ על "אפשר".\n7. ⇧🔊 נפח מקסימלי. למדידת קול מדויקת, נא למקסם את עוצמת הקול של המחשב כעת, ולאחר מכן אל תיגע בעוצמת הקול עד לסיום ההפעלה.\n8. לחץ על המשך או הקש על RETURN.',
