    id: 'showMeasuredSoundLevelBool bernilai TRUE dalam satu atau beberapa kondisi, sehingga mikrofon diperlukan untuk melakukan pengukuran tersebut.\n1. HUBUNGKAN mikrofon miniDSP UMIK-1 atau 2 Anda ke komputer ini.\n2. PILIH mikrofon tersebut pada jendela pop-up input suara di bawah.\n3. PILIH nama model mikrofon, UMIK-1 atau 2.\n4. Masukkan nomor SERIAL, lalu klik tombol FETCH PROFILE.\n5. ATUR MIKROFON\n a. Rentangkan ketiga kaki tripod sejauh mungkin. \n b. Klip mikrofon tripod berada pada posisi putar. Putar klip sepenuhnya ke sisi mana pun yang membuat tepi tertinggi klip lebih tinggi. \n c. Masukkan mikrofon ke dalam klip tripod, dari bawah, hingga ujung bawah mikrofon sejajar dengan tepi terendah klip. \n d. Sesuaikan kemiringan agar mikrofon vertikal, mengarah ke langit-langit.\n  e. Letakkan tripod di atas meja di antara Anda dan komputer. Putar tripod untuk mendekatkan mikrofon ke sisi Anda.\n  f. Dorong tripod ke arah komputer Anda (atau apa pun yang memiliki speaker) hingga kedua kaki tripod yang jauh hampir menyentuhnya, dan kaki ketiga berada di dekat Anda.\n6. IZINKAN PENGGUNAAN MIKROFON. Jika muncul pop-up yang meminta izin untuk menggunakan mikrofon, klik "Izinkan".\n7. ⇧🔊 VOLUME MAKSIMAL. Untuk pengukuran suara yang akurat, maksimalkan volume suara komputer Anda sekarang, lalu jangan sentuh volume hingga sesi berakhir.\n8. Klik LANJUTKAN atau tekan RETURN.',
    it: "Loading...",
    ja: "Loading...",
    kn: 'showMeasuredSoundLevelBool ಒಂದು ಅಥವಾ ಹೆಚ್ಚಿನ ಪರಿಸ್ಥಿತಿಗಳಲ್ಲಿ ನಿಜವಾಗಿದೆ, ಆದ್ದರಿಂದ ಆ ಅಳತೆಗಳನ್ನು ಮಾಡಲು ಮೈಕ್ರೊಫೋನ್ ಅಗತ್ಯವಿದೆ.\n1. ನಿಮ್ಮ miniDSP UMIK-1 ಅಥವಾ 2 ಮೈಕ್ರೊಫೋನ್ ಅನ್ನು ಈ ಕಂಪ್ಯೂಟರ್‌ಗೆ ಸಂಪರ್ಕಿಸಿ.\n2. ಕೆಳಗಿನ ಧ್ವನಿ ಇನ್‌ಪುಟ್ ಪಾಪ್-ಅಪ್‌ನಲ್ಲಿ ಆ ಮೈಕ್ರೊಫೋನ್ ಆಯ್ಕೆಮಾಡಿ.\n3. ಮೈಕ್ರೊಫೋನ್ ಮಾದರಿಯ ಹೆಸರನ್ನು ಆಯ್ಕೆ ಮಾಡಿ, UMIK-1 ಅಥವಾ 2.\n4. SERIAL ಸಂಖ್ಯೆಯನ್ನು ನಮೂದಿಸಿ, ಮತ್ತು FETCH PROFILE ಬಟನ್ ಅನ್ನು ಕ್ಲಿಕ್ ಮಾಡಿ.\n5. ಮೈಕ್ರೊಫೋನ್ ಹೊಂದಿಸಿ\n ಎ. ಮೂರು ಟ್ರೈಪಾಡ್ ಕಾಲುಗಳನ್ನು ಅವರು ಹೋಗುವಷ್ಟು ಹರಡಿ. \n ಬಿ. ಟ್ರೈಪಾಡ್‌ನ ಮೈಕ್ರೊಫೋನ್ ಕ್ಲಿಪ್ ಸ್ವಿವೆಲ್‌ನಲ್ಲಿದೆ. ಕ್ಲಿಪ್‌ನ ಅತ್ಯುನ್ನತ ಅಂಚನ್ನು ಯಾವ ಬದಿಗೆ ಹೆಚ್ಚಿಸುತ್ತದೋ ಆ ಕಡೆಗೆ ಕ್ಲಿಪ್ ಅನ್ನು ತಿರುಗಿಸಿ. \n ಸಿ. ಮೈಕ್ರೊಫೋನ್ ಅನ್ನು ಟ್ರೈಪಾಡ್ ಕ್ಲಿಪ್‌ಗೆ ಕೆಳಗಿನಿಂದ ಸೇರಿಸಿ, ಮೈಕ್ರೊಫೋನ್‌ನ ಕೆಳಭಾಗದ ತುದಿಯು ಕ್ಲಿಪ್‌ನ ಕೆಳ ಅಂಚಿನೊಂದಿಗೆ ಫ್ಲಶ್ ಆಗುವವರೆಗೆ. \n ಡಿ. ಮೈಕ್ರೊಫೋನ್ ಅನ್ನು ಲಂಬವಾಗಿ ಮಾಡಲು ಟಿಲ್ಟ್ ಅನ್ನು ಹೊಂದಿಸಿ, ಮೇಲ್ಛಾವಣಿಯ ಕಡೆಗೆ ತೋರಿಸುತ್ತದೆ. \n ಇ. ನಿಮ್ಮ ಮತ್ತು ನಿಮ್ಮ ಕಂಪ್ಯೂಟರ್ ನಡುವಿನ ಮೇಜಿನ ಮೇಲೆ ಟ್ರೈಪಾಡ್ ಅನ್ನು ಇರಿಸಿ. ಮೈಕ್ರೊಫೋನ್ ಅನ್ನು ನಿಮ್ಮ ಬದಿಗೆ ತರಲು ಟ್ರೈಪಾಡ್ ಅನ್ನು ತಿರುಗಿಸಿ. \n f. ಟ್ರೈಪಾಡ್‌ನ ದೂರದ ಎರಡು ಕಾಲುಗಳು ಅದನ್ನು ಸ್ಪರ್ಶಿಸುವವರೆಗೆ ಮತ್ತು ಮೂರನೇ ಕಾಲು ನಿಮ್ಮ ಹತ್ತಿರ ಇರುವವರೆಗೆ ಟ್ರೈಪಾಡ್ ಅನ್ನು ನಿಮ್ಮ ಕಂಪ್ಯೂಟರ್‌ಗೆ (ಅಥವಾ ಸ್ಪೀಕರ್‌ಗಳನ್ನು ಹೊಂದಿರುವ ಯಾವುದಾದರೂ) ಕಡೆಗೆ ತಳ್ಳಿರಿ.\n6. ಮೈಕ್ರೊಫೋನ್ ಬಳಕೆಯನ್ನು ಅನುಮತಿಸಿ. ಮೈಕ್ರೊಫೋನ್ ಬಳಸಲು ಪಾಪ್ ಅಪ್ ಅನುಮತಿ ಕೇಳಿದರೆ, "ಅನುಮತಿಸು" ಕ್ಲಿಕ್ ಮಾಡಿ.\n7. ⇧🔊 ಗರಿಷ್ಠ ಸಂಪುಟ. ನಿಖರವಾದ ಧ್ವನಿ ಮಾಪನಕ್ಕಾಗಿ, ದಯವಿಟ್ಟು ಈಗ ನಿಮ್ಮ ಕಂಪ್ಯೂಟರ್‌ನ ಧ್ವನಿಯ ಪರಿಮಾಣವನ್ನು ಹೆಚ್ಚಿಸಿ ಮತ್ತು ನಂತರ ಸೆಷನ್ ಮುಗಿಯುವವರೆಗೆ ವಾಲ್ಯೂಮ್ ಅನ್ನು ಸ್ಪರ್ಶಿಸಬೇಡಿ.\n8. ಮುಂದುವರೆಯಿರಿ ಕ್ಲಿಕ್ ಮಾಡಿ ಅಥವಾ ರಿಟರ್ನ್ ಒತ್ತಿರಿ.',
