    ms: 'showMeasuredSoundLevelBool adalah BENAR dalam satu atau lebih keadaan, jadi mikrofon diperlukan untuk membuat ukuran tersebut.\n1. SAMBUNG mikrofon miniDSP UMIK-1 atau 2 anda ke komputer ini.\n2. PILIH mikrofon itu pada pop timbul input bunyi di bawah.\n3. PILIH nama model mikrofon, UMIK-1 atau 2.\n4. Masukkan nombor SIRI, dan klik butang AMBIL PROFIL.\n5. SEDIAKAN MIKROFON\n a. Sebarkan ketiga-tiga kaki tripod sejauh yang mereka akan pergi. \n b. Klip mikrofon tripod dipusing. Pusing klip ke mana-mana bahagian yang menjadikan tepi tertinggi klip lebih tinggi. \n c. Masukkan mikrofon ke dalam klip tripod, dari bawah, sehingga hujung bawah mikrofon siram dengan tepi terendah klip. \n d. Laraskan kecondongan untuk menjadikan mikrofon menegak, menghala ke siling. \n e. Letakkan tripod di atas meja antara anda dan komputer anda. Putar tripod untuk membawa mikrofon ke sisi anda. \n f. Tolak tripod ke arah komputer anda (atau apa sahaja yang mempunyai pembesar suara) sehingga dua kaki tripod hampir menyentuhnya, dan kaki ketiga berada berhampiran anda.\n6. BENARKAN PENGGUNAAN MIKROFON. Jika pop timbul meminta kebenaran untuk menggunakan mikrofon, klik "Benarkan".\n7. ⇧🔊 ISI PADU MAKSIMAL. Untuk pengukuran bunyi yang tepat, sila maksimumkan kelantangan bunyi komputer anda sekarang, dan kemudian jangan sentuh kelantangan sehingga sesi tamat.\n8. Klik PROCEED atau tekan RETURN.',
