    pt: 'showMeasuredSoundLevelBool é TRUE em uma ou mais condições, portanto, um microfone é necessário para realizar essas medições.\n1. CONECTE seu microfone miniDSP UMIK-1 ou 2 a este computador.\n2. SELECIONE o microfone na janela pop-up de entrada de som abaixo.\n3. SELECIONE o nome do modelo do microfone, UMIK-1 ou 2.\n4. Digite o número de série e clique no botão FETCH PROFILE.\n5. CONFIGURE O MICROFONE\n a. Abra as três pernas do tripé o máximo possível.\n  b. O clipe do microfone do tripé está em um suporte giratório. Gire o clipe totalmente para o lado que deixar a borda mais alta do clipe mais alta.\n  c. Insira o microfone no clipe do tripé, por baixo, até que a extremidade inferior do microfone fique alinhada com a borda mais baixa do clipe.\n  d. Ajuste a inclinação para deixar o microfone na vertical, apontando para o teto.\n  e. Coloque o tripé sobre a mesa, entre você e o computador. Gire o tripé para trazer o microfone para o seu lado.\n  f. Empurre o tripé em direção ao computador (ou a qualquer lugar onde haja alto-falantes) até que as duas pernas mais distantes do tripé quase o toquem e a terceira perna fique próxima de você.\n6. PERMITA O USO DO MICROFONE. Se uma janela pop-up solicitar permissão para usar o microfone, clique em "Permitir".\n7. ⇧🔊 VOLUME MÁXIMO. Para uma medição precisa do som, maximize o volume do seu computador agora e não toque no volume até o término da sessão.\n8. Clique em PROSSEGUIR ou pressione ENTER.',
    ro: "Loading...",
    ru: "Параметр showMeasuredSoundLevelBool принимает значение TRUE при одном или нескольких условиях, поэтому для проведения этих измерений необходим микрофон.\n1. ПОДКЛЮЧИТЕ микрофон miniDSP UMIK-1 или 2 к этому компьютеру.\n2. ВЫБЕРИТЕ этот микрофон во всплывающем окне выбора звука ниже.\n3. ВЫБЕРИТЕ название модели микрофона: UMIK-1 или 2.\n4. Введите СЕРИЙНЫЙ номер и нажмите кнопку «ПОЛУЧИТЬ ПРОФИЛЬ».\n5. НАСТРОЙКА МИКРОФОНА\na. Раздвиньте три ножки штатива как можно шире.\nb. Зажим микрофона на штативе имеет шарнирное соединение. Поверните зажим до упора в ту сторону, где его верхний край окажется выше.\nc. Вставьте микрофон в зажим штатива снизу, пока его нижний конец не совпадет с нижним краем зажима.\nd. Отрегулируйте наклон так, чтобы микрофон был направлен вертикально в потолок. \n  д. Поставьте штатив на стол между вами и компьютером. Поверните штатив, чтобы микрофон оказался сбоку. \n  е. Придвиньте штатив к компьютеру (или устройству с динамиками) так, чтобы две крайние ножки штатива почти коснулись его, а третья ножка оказалась рядом с вами.\n6. РАЗРЕШИТЕ ИСПОЛЬЗОВАНИЕ МИКРОФОНА. Если появится всплывающее окно с запросом на использование микрофона, нажмите «Разрешить».\n7. ⇧🔊 МАКСИМАЛЬНАЯ ГРОМКОСТЬ. Для точного измерения звука установите максимальную громкость звука компьютера и не изменяйте её до завершения сеанса.\n8. Нажмите «ПРОДОЛЖИТЬ» или «ВВОД».",
