    sw: 'showMeasuredSoundLevelBool ni TRUE katika hali moja au zaidi, kwa hivyo maikrofoni inahitajika ili kufanya vipimo hivyo.\n1. UNGANISHA miniDSP yako ya UMIK-1 au maikrofoni 2 kwenye kompyuta hii.\n2. CHAGUA maikrofoni hiyo kwenye kiibukizi cha ingizo la sauti hapa chini.\n3. CHAGUA jina la muundo wa maikrofoni, UMIK-1 au 2.\n4. Ingiza nambari ya SERIAL, na ubofye kitufe cha GETCH PROFILE.\n5. WEKA MICROPHONE\n a. Kueneza miguu mitatu ya tripod mbali kama wao kwenda. \n b. Klipu ya maikrofoni ya tripod iko kwenye mzunguko. Sogeza klipu hadi upande wowote hufanya makali ya juu zaidi ya klipu kuwa juu. \n c. Ingiza maikrofoni kwenye klipu ya tripod, kutoka chini, hadi mwisho wa maikrofoni uwe laini na ukingo wa chini kabisa wa klipu. \n d. Rekebisha kuinamisha ili kufanya maikrofoni iwe wima, ikielekeza juu ya dari. \n e. Weka tripod kwenye meza kati yako na kompyuta yako. Zungusha tripod ili kuleta maikrofoni kando yako. \n f. Sukuma tripod kuelekea kompyuta yako (au chochote kilicho na spika) hadi miguu miwili ya mbali ya tripod ikaribie kuigusa, na mguu wa tatu uwe karibu nawe.\n6. RUHUSU MATUMIZI YA MICROPHONE. Iwapo dirisha ibukizi litaomba ruhusa ya kutumia maikrofoni, bofya "Ruhusu".\n7. ⇧🔊 MAX VOLUME. Kwa kipimo sahihi cha sauti, tafadhali ongeza sauti ya kompyuta yako sasa, kisha usiguse sauti hadi kipindi kiishe.\n8. Bonyeza PROCEED au bonyeza RETURN.',
