    is: "Við mælum fjarlægðina á milli augna þinna. Notaðu myndbandsmyndina til að horfa á augun þín. Haltu penna láréttum að andliti þínu fyrir framan augun. Stilltu hægri og vinstri þumalfingursnöglum þínum við miðju hægri og vinstri sjáaldranna. Komdu síðan með pennann að reglustikunni á skjánum til að mæla bilið á milli þumalfingranna. Stilltu vinstri þumalfingri við núll og taktu eftir hvar hægri þumalfingur þinn er. Leggðu frá þér pennann og smelltu á reglustikuna á þeim tímapunkti. Að lokum, smelltu á OK til að halda áfram.",
    id: "Loading...",
    it: "Misureremo la distanza tra i tuoi occhi. Usa l'immagine video per osservare i tuoi occhi. Tieni una penna orizzontalmente contro il viso, davanti agli occhi. Allinea l'unghia del pollice destro e sinistro con il centro delle pupille destra e sinistra. Quindi avvicina la penna al righello sullo schermo per misurare la distanza tra i pollici. Allinea il pollice sinistro allo zero e nota dove si trova il pollice destro. Appoggia la penna e clicca sul righello in quel punto. Infine, clicca su OK per continuare.",
    ja: "Loading...",
    kn: "ನಿಮ್ಮ ಕಣ್ಣುಗಳ ನಡುವಿನ ಅಂತರವನ್ನು ನಾವು ಅಳೆಯುತ್ತೇವೆ. ನಿಮ್ಮ ಕಣ್ಣುಗಳನ್ನು ವೀಕ್ಷಿಸಲು ವೀಡಿಯೊ ಚಿತ್ರವನ್ನು ಬಳಸಿ. ನಿಮ್ಮ ಕಣ್ಣುಗಳ ಮುಂದೆ ನಿಮ್ಮ ಮುಖದ ವಿರುದ್ಧ ಪೆನ್ನನ್ನು ಅಡ್ಡಲಾಗಿ ಹಿಡಿದುಕೊಳ್ಳಿ. ನಿಮ್ಮ ಬಲ ಮತ್ತು ಎಡ ಹೆಬ್ಬೆರಳಿನ ಉಗುರುಗಳನ್ನು ನಿಮ್ಮ ಬಲ ಮತ್ತು ಎಡ ವಿದ್ಯಾರ್ಥಿಗಳ ಮಧ್ಯಭಾಗದೊಂದಿಗೆ ಜೋಡಿಸಿ. ನಂತರ ನಿಮ್ಮ ಹೆಬ್ಬೆರಳುಗಳ ನಡುವಿನ ಪ್ರತ್ಯೇಕತೆಯನ್ನು ಅಳೆಯಲು ಆನ್-ಸ್ಕ್ರೀನ್ ರೂಲರ್‌ಗೆ ಪೆನ್ ಅನ್ನು ತನ್ನಿ. ನಿಮ್ಮ ಎಡಗೈ ಹೆಬ್ಬೆರಳನ್ನು ಸೊನ್ನೆಯಿಂದ ಜೋಡಿಸಿ ಮತ್ತು ನಿಮ್ಮ ಬಲ ಹೆಬ್ಬೆರಳು ಎಲ್ಲಿದೆ ಎಂಬುದನ್ನು ಗಮನಿಸಿ. ಪೆನ್ ಕೆಳಗೆ ಇರಿಸಿ ಮತ್ತು ಆ ಸಮಯದಲ್ಲಿ ರೂಲರ್ ಅನ್ನು ಕ್ಲಿಕ್ ಮಾಡಿ. ಅಂತಿಮವಾಗಿ, ಮುಂದುವರೆಯಲು ಸರಿ ಕ್ಲಿಕ್ ಮಾಡಿ.",
    ko: "Loading...",
    lt: "Mes išmatuosime atstumą tarp jūsų akių. Norėdami stebėti savo akis, naudokite vaizdo įrašo vaizdą. Laikykite rašiklį horizontaliai prie veido prieš akis. Sulygiuokite dešiniojo ir kairiojo nykščio nagus su dešiniojo ir kairiojo vyzdžių centrais. Tada nuneškite rašiklį prie ekrano liniuotės, kad pamatytumėte atstumą tarp nykščių. Kairįjį nykštį sulygiuokite su nuliu ir atkreipkite dėmesį, kur yra dešinysis nykštys. Nuleiskite rašiklį ir spustelėkite liniuotę toje vietoje. Galiausiai spustelėkite Gerai, kad tęstumėte.",
    ms: "Loading...",
    ml: "Loading...",
    no: "Loading...",
    fa: "ما فاصله بین چشمان شما را اندازه می گیریم. از تصویر ویدیویی برای تماشای چشمان خود استفاده کنید. یک خودکار را به صورت افقی در مقابل چشمان خود نگه دارید. ناخن های شست راست و چپ خود را با مرکز مردمک های راست و چپ خود تراز کنید. سپس قلم را به خط کش روی صفحه بیاورید تا فاصله بین انگشتان شست خود را اندازه گیری کنید. انگشت شست چپ خود را با صفر تراز کنید و توجه کنید که شست راست شما کجاست. قلم را زمین بگذارید و روی خط کش در آن نقطه کلیک کنید. در نهایت برای ادامه روی OK کلیک کنید.",
    pl: "Loading...",
    pt: "Loading...",
    ro: "Vom măsura distanța dintre ochii tăi. Utilizați imaginea video pentru a vă urmări ochii. Țineți un stilou orizontal pe față în fața ochilor. Aliniați unghiile degetului mare drept și stâng cu centrul pupilei drepte și stângi. Apoi aduceți stiloul la rigla de pe ecran pentru a măsura distanța dintre degetele dvs. mari. Aliniați degetul mare stâng cu zero și observați unde este degetul mare drept. Puneți stiloul jos și faceți clic pe riglă în acel punct. În cele din urmă, faceți clic pe OK pentru a continua.",
    ru: "Loading...",
    sr: "Измерићемо растојање између ваших очију. Користите видео слику да гледате своје очи. Држите оловку хоризонтално уз лице испред очију. Поравнајте нокте десног и левог палца са центрима десне и леве зенице. Затим принесите оловку лењиру на екрану да бисте измерили размак између палчева. Поравнајте леви палац са нулом и приметите где вам је десни палац. Спустите оловку и кликните на лењир на том месту. На крају, кликните на ОК да наставите.",
    es: "Loading...",
    sw: "Loading...",
    sv: "Loading...",
    tl: "Susukatin namin ang distansya sa pagitan ng iyong mga mata. Gamitin ang larawan ng video upang panoorin ang iyong mga mata. Hawakan ang panulat nang pahalang sa iyong mukha sa harap ng iyong mga mata. Ihanay ang iyong kanan at kaliwang mga kuko ng hinlalaki sa mga gitna ng iyong kanan at kaliwang mga mag-aaral. Pagkatapos ay dalhin ang panulat sa on-screen ruler upang sukatin ang paghihiwalay sa pagitan ng iyong mga hinlalaki. I-align ang iyong kaliwang hinlalaki sa zero at pansinin kung nasaan ang iyong kanang hinlalaki. Ibaba ang panulat at i-click ang ruler sa puntong iyon. Panghuli, i-click ang OK upang magpatuloy.",
    tr: "Gözleriniz arasındaki mesafeyi ölçeceğiz. Gözlerinizi izlemek için video görüntüsünü kullanın. Bir kalemi gözlerinizin önünde yüzünüze yatay olarak tutun. Sağ ve sol başparmak tırnaklarınızı sağ ve sol göz bebeklerinizin ortasıyla hizalayın. Ardından, başparmaklarınız arasındaki mesafeyi ölçmek için kalemi ekrandaki cetvele götürün. Sol baş parmağınızı sıfır noktasına hizalayın ve sağ baş parmağınızın nerede olduğuna dikkat edin. Kalemi bırakın ve cetvele o noktada tıklayın. Son olarak, devam etmek için Tamam'a tıklayın.",
    ur: "ہم آپ کی آنکھوں کے درمیان فاصلے کی پیمائش کریں گے۔ اپنی آنکھوں کو دیکھنے کے لیے ویڈیو امیج کا استعمال کریں۔ اپنی آنکھوں کے سامنے اپنے چہرے کے خلاف افقی طور پر قلم پکڑیں۔ اپنے دائیں اور بائیں انگوٹھے کے ناخنوں کو اپنے دائیں اور بائیں شاگردوں کے مراکز کے ساتھ سیدھ میں رکھیں۔ پھر اپنے انگوٹھوں کے درمیان علیحدگی کی پیمائش کرنے کے لیے قلم کو آن اسکرین رولر پر لائیں۔ اپنے بائیں انگوٹھے کو صفر کے ساتھ سیدھا کریں اور دیکھیں کہ آپ کا دایاں انگوٹھا کہاں ہے۔ قلم نیچے رکھیں اور اس مقام پر حکمران پر کلک کریں۔ آخر میں، جاری رکھنے کے لیے ٹھیک ہے پر کلک کریں۔",
