    nl: "Loading...",
    fi: "Loading...",
    fr: "Loading...",
    de: "GEWÄHRLEISTUNG DES KAMERASTRAHLUNGSSCHUTZES. Es werden keine Fotos oder Videos aufgezeichnet. Jedes Webcam-Bild wird ausschließlich innerhalb dieses Computers verwendet, um die Augen- und Blickpositionen abzuschätzen, und anschließend innerhalb von 10 Sekunden gelöscht. Nur die Augen- und Blickpositionen bleiben erhalten.",
    el: "ΔΙΑΣΦΑΛΙΣΗ ΑΠΟΡΡΗΤΟΥ ΤΗΣ ΚΑΜΕΡΑΣ. Δεν εγγράφονται φωτογραφίες ή βίντεο. Κάθε πλαίσιο κάμερας web χρησιμοποιείται μόνο μέσα σε αυτόν τον υπολογιστή, αποκλειστικά για την εκτίμηση της θέσης των ματιών και του βλέμματος, και στη συνέχεια διαγράφεται εντός 10 δευτερολέπτων. Διατηρούνται μόνο οι θέσεις των ματιών και του βλέμματος.",
    he: "Loading...",
    hi: "Loading...",
    hu: "A KAMERA ADATVÉDELME BIZTOSÍTÁSA. Nem rögzítenek fényképeket vagy videót. Minden webkamera keret csak a számítógépen belül használható, kizárólag a szem és a tekintet helyzetének becslésére, majd 10 másodpercen belül törlésre kerül. Csak a szem és a tekintet helyzete marad meg.",
    is: "FYRIR FRÆÐI MYNDAVÉR. Engar myndir eða myndskeið eru tekin upp. Hver vefmyndavélarrammi er aðeins notaður inni í þessari tölvu, eingöngu til að áætla augn- og augnastöður, og síðan eytt innan 10 sekúndna. Aðeins augn- og augnstöður haldast.",
    id: "Loading...",
    it: "GARANZIA DI PRIVACY DELLA FOTOCAMERA. Non vengono registrate foto o video. Ogni fotogramma della webcam viene utilizzato solo all'interno di questo computer, esclusivamente per stimare la posizione degli occhi e dello sguardo, e poi cancellato entro 10 secondi. Vengono mantenute solo la posizione degli occhi e dello sguardo.",
    ja: "カメラのプライバシー保護。写真や動画は記録されません。ウェブカメラのフレームは、このコンピューター内でのみ、視線と目の位置を推定するために使用され、10秒以内に消去されます。保持されるのは視線と目の位置のみです。",
    kn: "Loading...",
    ko: "Loading...",
    lt: "Loading...",
    ms: "Loading...",
    ml: "ക്യാമറ സ്വകാര്യതയുടെ ഉറപ്പ്. ഫോട്ടോകളോ വീഡിയോകളോ രേഖപ്പെടുത്തിയിട്ടില്ല. ഓരോ വെബ്‌ക്യാം ഫ്രെയിമും ഈ കമ്പ്യൂട്ടറിനുള്ളിൽ മാത്രമേ ഉപയോഗിക്കുന്നുള്ളൂ, കണ്ണിൻ്റെയും നോട്ടത്തിൻ്റെയും സ്ഥാനങ്ങൾ കണക്കാക്കാൻ മാത്രം, തുടർന്ന് 10 സെക്കൻഡിനുള്ളിൽ മായ്‌ക്കപ്പെടും. കണ്ണിൻ്റെയും നോട്ടത്തിൻ്റെയും സ്ഥാനങ്ങൾ മാത്രം നിലനിർത്തിയിരിക്കുന്നു.",
    no: "SIKRING OM KAMERAPERSONVERN. Ingen bilder eller video er tatt opp. Hver webkameraramme brukes kun inne i denne datamaskinen, utelukkende for å beregne øye- og blikkposisjoner, og slettes deretter innen 10 sekunder. Kun øye- og blikkposisjonene beholdes.",
    fa: "Loading...",
    pl: "GWARANCJA PRYWATNOŚCI KAMERY. Żadne zdjęcia ani nagrania wideo nie są rejestrowane. Każda klatka z kamery internetowej jest używana wyłącznie w tym komputerze, wyłącznie do oszacowania pozycji oczu i spojrzenia, a następnie usuwana w ciągu 10 sekund. Zachowywane są tylko pozycje oczu i spojrzenia.",
    pt: "GARANTIA DE PRIVACIDADE DA CÂMERA. Nenhuma foto ou vídeo é gravado. Cada quadro da webcam é usado apenas dentro deste computador, exclusivamente para estimar as posições dos olhos e do olhar, e então apagado em até 10 segundos. Apenas as posições dos olhos e do olhar são mantidas.",
    ro: "ASIGURAREA CONFIDENTIALITATII CAMERA. Nu sunt înregistrate fotografii sau videoclipuri. Fiecare cadru de cameră web este utilizat numai în interiorul acestui computer, numai pentru a estima pozițiile ochilor și privirii, apoi este șters, în decurs de 10 secunde. Sunt păstrate doar pozițiile ochilor și privirii.",
    ru: "Loading...",
    sr: "ГАРАНЦИЈА ПРИВАТНОСТИ КАМЕРЕ. Не снимају се фотографије или видео записи. Сваки оквир веб камере се користи само унутар овог рачунара, искључиво за процену положаја очију и погледа, а затим се брише у року од 10 секунди. Задржавају се само положаји очију и погледа.",
