    fa: "Loading...",
    pl: "Loading...",
    pt: "Loading...",
    ro: "Loading...",
    ru: "ВЫБЕРИТЕ СПОСОБ КАЛИБРОВКИ ДИНАМИКОВ:\n1. УЖЕ ВЫПОЛНЕНО. Если вы ранее откалибровали динамики этого компьютера, вы можете пропустить повторную калибровку, повторно используя существующий профиль калибровки. В противном случае выберите микрофон для калибровки. Примечание: Правила безопасности веб-приложений ограничивают распознаваемость компьютера, поэтому уже откалиброванный компьютер может остаться нераспознанным. В этом случае просто выполните повторную калибровку. Вероятно, он будет распознан в следующий раз.\n2. СМАРТФОН. Используйте встроенный микрофон смартфона.\n3. USB. Если у вас есть микрофон miniDSP UMIK-1 или UMIK-2 (доступен на Amazon), выберите «USB» и подключите микрофон к этому компьютеру.",
