      "1. Place this phone on your platform so that its microphone (this edge ⇧) faces your computer.\n2. Adjust phone position and platform height so that the microphone is on your line of sight to the speakers, which are typically in the keyboard. \n3. Tap PROCEED.\n4. If the button doesn't respond, refresh this screen (tap address; tap go) or point the camera at the QR code again.",
    ar: '١. ضع هذا الهاتف على منصتك بحيث يكون الميكروفون (هذه الحافة ⇧) مواجهًا لجهاز الكمبيوتر.\n\n٢. اضبط موضع الهاتف وارتفاع المنصة بحيث يكون الميكروفون في مجال رؤيتك لمكبرات الصوت، والتي عادةً ما تكون في لوحة المفاتيح.\n\n٣. انقر على "متابعة".\n\n٤. إذا لم يستجب الزر، فقم بتحديث هذه الشاشة (انقر على العنوان؛ انقر على "انتقال") أو وجّه الكاميرا نحو رمز الاستجابة السريعة مرة أخرى.',
