    hr: "1. Postavite ovaj telefon na svoju platformu tako da njegov mikrofon (ovaj rub ⇧) bude okrenut prema vašem računalu.\n2. Podesite položaj telefona i visinu platforme tako da vam mikrofon bude u vidnom polju u odnosu na zvučnike, koji su obično u tipkovnici. \n3. Dodirnite NASTAVI.\n4. Ako gumb ne reagira, osvježite ovaj zaslon (dodirnite adresu; dodirnite idi) ili ponovno usmjerite kameru prema QR kodu.",
    cs: "Loading...",
    da: "1. Placer denne telefon på din platform, så dens mikrofon (denne kant ⇧) vender mod din computer.\n2. Juster telefonens position og platformshøjde, så mikrofonen er på din synslinje til højttalerne, som typisk er i tastaturet. \n3. Tryk på FORTSÆT.\n4. Hvis knappen ikke reagerer, skal du opdatere denne skærm (tryk på adressen; tryk på gå) eller pege kameraet mod QR-koden igen.",
    nl: "Loading...",
