    el: "1. Τοποθετήστε αυτό το τηλέφωνο στην πλατφόρμα σας έτσι ώστε το μικρόφωνό του (αυτή η άκρη ⇧) να βλέπει προς τον υπολογιστή σας.\n2. Προσαρμόστε τη θέση του τηλεφώνου και το ύψος της πλατφόρμας, έτσι ώστε το μικρόφωνο να βρίσκεται σε οπτική επαφή με τα ηχεία, τα οποία βρίσκονται συνήθως στο πληκτρολόγιο. \n3. Πατήστε ΣΥΝΕΧΕΙΑ.\n4. Εάν το κουμπί δεν ανταποκρίνεται, ανανεώστε αυτήν την οθόνη (πατήστε διεύθυνση, πατήστε μετάβαση) ή στρέψτε ξανά την κάμερα στον κωδικό QR.",
