      "The LLL size and spacing vary from big and easy down to tiny and hard. You can't get much more than two-thirds right, so relax. Think of it as a guessing game, and just get as many as you can. You'll hear a beep whenever you're right.",
    ar: "يتراوح حجم ومسافة خط الطول بين الكبير والسهل والصغير والصعب. لا يمكنك الحصول على أكثر من ثلثي الإجابة الصحيحة، لذا لا تقلق. تخيل الأمر كلعبة تخمين، وحاول قدر الإمكان. ستسمع صوت تنبيه عندما تكون الإجابة صحيحة.",
