    lt: "LLL dydis ir tarpai skiriasi nuo didelių ir lengvų iki mažų ir kietų. Negalite gauti daug daugiau nei du trečdalius, todėl atsipalaiduokite. Pagalvokite apie tai kaip apie atspėjimo žaidimą ir tiesiog gaukite kuo daugiau. Kai būsite teisūs, išgirsite pyptelėjimą.",
    ms: "Saiz dan jarak PLL berbeza-beza dari besar dan mudah ke kecil dan keras. Anda tidak boleh mendapatkan lebih daripada dua pertiga betul, jadi berehat. Anggap ia sebagai permainan meneka, dan dapatkan seberapa banyak yang anda boleh. Anda akan mendengar bunyi bip apabila anda betul.",
    ml: "Loading...",
