    bg: "НА ДАЛЕЧНИ РАЗСТОЯНИЯ ЩЕ ИЗПОЛЗВАТЕ ТЕЛЕФОНА СИ КАТО КЛАВИАТУРА. Свържете го сега за използване по-късно. Насочете камерата на вашия смартфон към този QR код. След това докоснете връзката, която се появява на екрана на вашия смартфон.",
