    tl: "Loading...",
    tr: "Her denemede, çarpıya bakarken, gözünüzün köşesinde rastgele bir LLL YANIP SÖNECEK. Sadece bir şimşek. Görevi öğrenmek için önce STATİK bir ekranla deneyelim. Aşağıdaki çarpıya bakarken, gözlerinizi hareket ettirmeden: Bu LLL nedir?\n\n+ R\n\nBu bir R. Bu ekran statik olduğundan, gözlerinizi LLL'ye götürüp tespit etmeniz kolay olacaktır. Ancak gerçek bir denemede LLL YANIP SÖNÜYOR, yani gözlerinizi hareket ettirecek zamanınız yok. Lütfen denemeye başlarken çarpıya bakın. Flaştan sonra gözlerinizin nereye gittiği önemli değil. İlk test bloğu, ciddi olarak başlamadan önce sadece birkaç pratik denemeden oluşuyor.",
    ur: "ہر آزمائش پر، جب آپ صلیب کو دیکھتے ہیں، تو آپ کی آنکھ کے کونے میں ایک بے ترتیب LLL چمکے گا۔ صرف ایک فلیش۔ کام سیکھنے کے لیے، آئیے پہلے اسے ایک STATIC ڈسپلے کے ساتھ آزماتے ہیں۔ کراس کو دیکھتے ہوئے، نیچے، اپنی آنکھوں کو منتقل کیے بغیر: یہ کیا ہے؟\n\n             + آر  \n\nیہ ایک R ہے۔ یہ ڈسپلے جامد ہے، لہذا اپنی آنکھوں کو LLL کی طرف منتقل کرنا اور اس کی شناخت کرنا آسان ہوگا۔ لیکن، ایک حقیقی آزمائش میں، LLL چمکتا ہے، لہذا آپ کی آنکھوں کو منتقل کرنے کا کوئی وقت نہیں ہے. ٹرائل شروع کرتے وقت براہ کرم صلیب کو دیکھیں۔ اس سے کوئی فرق نہیں پڑتا کہ فلیش کے بعد آپ کی آنکھیں کہاں جاتی ہیں۔ ٹیسٹنگ کا پہلا بلاک مشق کے صرف چند ٹرائلز ہیں، اس سے پہلے کہ ہم سنجیدگی سے شروع کریں۔",
