    sv: "Loading...",
    tl: "Sa bawat pagsubok, habang tumitingin ka sa krus, isang random na letra ang mag-FLASH sa sulok ng iyong mata. Isang flash lang. Upang matutunan ang gawain, subukan muna natin ito gamit ang isang STATIC na display. Habang nakatingin sa krus, sa ibaba, nang hindi ginagalaw ang iyong mga mata: Anong letra ito?\n\n             +               R  \n\nIto ay isang R. Ang display na ito ay static, kaya magiging madaling ilipat ang iyong mga mata sa titik at tukuyin ito. Ngunit, sa isang tunay na pagsubok, ang sulat ay FLASHED, kaya walang oras upang ilipat ang iyong mga mata. Mangyaring tingnan ang krus habang sinisimulan mo ang paglilitis. Hindi mahalaga kung saan pupunta ang iyong mga mata pagkatapos ng flash. Ang unang bloke ng pagsubok ay ilan lamang sa mga pagsubok ng pagsasanay, bago tayo magsimula nang masigasig.",
