    ur: "ہر آزمائش پر، جب آپ صلیب کو دیکھیں گے، تو آپ کی آنکھ کے کونے میں ایک بے ترتیب خط چمکے گا۔ صرف ایک فلیش۔ کام سیکھنے کے لیے، آئیے پہلے اسے ایک STATIC ڈسپلے کے ساتھ آزماتے ہیں۔ کراس کو دیکھتے ہوئے، نیچے، اپنی آنکھوں کو ہلائے بغیر: یہ کون سا خط ہے؟\n\n             +              آر  \n\nیہ ایک R ہے۔ یہ ڈسپلے جامد ہے، اس لیے اپنی آنکھوں کو خط کی طرف منتقل کرنا اور اس کی شناخت کرنا آسان ہوگا۔ لیکن، ایک حقیقی آزمائش میں، خط چمکتا ہے، لہذا آپ کی آنکھوں کو منتقل کرنے کا کوئی وقت نہیں ہے. ٹرائل شروع کرتے وقت براہ کرم صلیب کو دیکھیں۔ اس سے کوئی فرق نہیں پڑتا کہ فلیش کے بعد آپ کی آنکھیں کہاں جاتی ہیں۔ ٹیسٹنگ کا پہلا بلاک مشق کے صرف چند ٹرائلز ہیں، اس سے پہلے کہ ہم سنجیدگی سے شروع کریں۔",
