    fa: "در هر آزمایش، در حالی که به صلیب نگاه می کنید، یک رقم تصادفی در گوشه چشم شما چشمک می زند. فقط یک فلش برای یادگیری کار، اجازه دهید ابتدا آن را با یک صفحه نمایش STATIC امتحان کنیم. در حالی که به صلیب، زیر، بدون حرکت چشمان خود نگاه می کنید: چه رقمی است؟\n\n             +               3  \n\n3 است. این صفحه نمایش ثابت است، بنابراین می توان چشمان خود را به سمت رقم حرکت داد و آن را شناسایی کرد. اما، در یک آزمایش واقعی، رقم چشمک می زند، بنابراین زمانی برای حرکت دادن چشمان شما وجود ندارد. لطفاً هنگام شروع محاکمه به صلیب نگاه کنید. مهم نیست چشمان شما پس از فلاش به کجا می روند. اولین بلوک آزمایش فقط چند آزمایش تمرین است، قبل از اینکه به طور جدی شروع کنیم.",
