    tr: "Her denemede, çarpıya bakarken, gözünüzün köşesinde rastgele bir rakam YANIP SÖNECEK. Sadece bir şimşek. Görevi öğrenmek için önce STATİK bir ekranla deneyelim. Aşağıdaki çarpıya gözlerinizi hareket ettirmeden bakarken: Hangi rakam?\n\n              +               3 \n\n3. Bu ekran statik olduğundan, gözlerinizi rakama götürüp tanımlamanız kolay olacaktır. Ancak gerçek bir denemede rakam YANIP SÖNÜYOR, yani gözlerinizi hareket ettirecek zamanınız yok. Lütfen denemeye başlarken çarpıya bakın. Flaştan sonra gözlerinizin nereye gittiği önemli değil. İlk test bloğu, ciddi olarak başlamadan önce sadece birkaç pratik denemesinden oluşuyor.",
