    "en-US":
      "On each trial, while you look at the cross, an image will FLASH in the corner of your eye. Just a flash. To learn the task, let’s try it first with a STATIC display of a letter. While looking at the cross, below, without moving your eyes: What letter is it?\n\n             +               R  \n\nIt’s an R. This display is static, so it would be easy to move your eyes to the image (the R) to identify it. But, in a real trial, the image is FLASHED, so there's no time to move your eyes. Please look at the cross as you initiate the trial. It doesn't matter where your eyes go after the flash. The first block of testing is just a few trials of practice, before we start in earnest.",
    ar: "Loading...",
    hy: "Յուրաքանչյուր փորձության ժամանակ, մինչ դուք նայում եք խաչին, ձեր աչքի անկյունում պատկերը կծկվի: Պարզապես մի ֆլեշ: Առաջադրանքը սովորելու համար նախ փորձենք այն տառի ՍՏԱՏԻԿ ցուցադրմամբ: Խաչին նայելիս, ներքևում, առանց աչքերը շարժելու. Ի՞նչ տառ է դա:\n\n             +               R  \n\nԴա R է: Այս էկրանը ստատիկ է, ուստի հեշտ կլինի ձեր աչքերը տեղափոխել պատկերին (R)՝ այն նույնացնելու համար: Բայց իրական փորձության դեպքում պատկերը ՇԱՅՏԱՑՎՈՒՄ է, ուստի ժամանակ չի մնում ձեր աչքերը շարժելու: Խնդրում եմ, նայեք խաչին, երբ նախաձեռնում եք դատավարությունը: Կարևոր չէ, թե ուր են գնում ձեր աչքերը լուսաբռնկումից հետո: Փորձարկման առաջին բլոկը պրակտիկայի ընդամենը մի քանի փորձ է, նախքան լրջորեն սկսելը:",
    bg: "При всяко изпитание, докато гледате кръста, в ъгъла на окото ви ще МИГА изображение. Само светкавица. За да научите задачата, нека първо я опитаме със СТАТИЧНО показване на буква. Докато гледате кръста отдолу, без да мърдате очите си: Коя буква е?\n\n             +               Р  \n\nТова е R. Този дисплей е статичен, така че би било лесно да преместите очите си към изображението (R), за да го идентифицирате. Но при реално изпитание изображението е МИГНАТО, така че няма време да мърдате очите си. Моля, погледнете кръста, докато започвате процеса. Няма значение накъде отиват очите ви след светкавицата. Първият блок от тестване е само няколко опита на практика, преди да започнем сериозно.",
    "zh-CN": "Loading...",
