    "en-US":
      "SOUND DETECTION\n\nYou will complete several trials. In each trial, you may or may not hear a target sound: one note repeated 8 times. Half of the trials include the target sound, and half do not.\n\nYour task: After listening, press “y” if you heard the target sound, or “n” if you did not. The volume will adjust as you go, making the target barely detectable.\n\nIn the practice block, the target will be alone. Later, other sounds will play too—ignore them and focus only on detecting the target.\n\nPress RETURN or click PROCEED. ",
    ar: 'اكتشاف الصوت\n\nستُكمل عدة محاولات. في كل محاولة، قد تسمع أو لا تسمع صوتًا مُستهدفًا: نغمة واحدة تُكرر 8 مرات. نصف المحاولات تتضمن صوت الهدف، والنصف الآخر لا يتضمنه.\n\nمهمتك: بعد الاستماع، اضغط على "y" إذا سمعت صوت الهدف، أو "n" إذا لم تسمعه. سيتم تعديل مستوى الصوت تدريجيًا، مما يجعل الهدف بالكاد يُسمع.\n\nفي مرحلة التدريب، سيكون الهدف وحيدًا. لاحقًا، ستُسمع أصوات أخرى أيضًا - تجاهلها وركز فقط على اكتشاف الهدف.\n\nاضغط على "RETURN" أو "PROCEED".',
