    nl: 'GELUIDSDETECTIE\n\nJe zult verschillende pogingen doen. Bij elke poging hoor je mogelijk wel of niet een doelgeluid: één noot die 8 keer wordt herhaald. De helft van de pogingen bevat het doelgeluid, de andere helft niet.\n\nJe opdracht: Druk na het luisteren op "y" als je het doelgeluid hebt gehoord, of op "n" als je het niet hebt gehoord. Het volume wordt aangepast naarmate je verdergaat, waardoor het doelgeluid nauwelijks hoorbaar is.\n\nIn het oefenblok is het doel alleen. Later worden ook andere geluiden afgespeeld - negeer deze en concentreer je alleen op het detecteren van het doelgeluid.\n\nDruk op RETURN of klik op DOORGAAN.',
