    el: "Loading...",
    he: 'זיהוי קול\n\nאתה תסיים מספר ניסויים. בכל ניסוי, אולי תשמע או לא תשמע צליל מטרה: צליל אחד שחוזר על עצמו 8 פעמים. מחצית מהניסויים כוללים את צליל המטרה, וחצי לא.\n\nהמשימה שלך: לאחר האזנה, הקש "y" אם שמעתם את צליל היעד, או "n" אם לא שמעתם. עוצמת הקול יתכוונן תוך כדי כך שהמטרה כמעט ואינה ניתנת לזיהוי.\n\nבבלוק התרגול, המטרה תהיה לבד. מאוחר יותר, גם צלילים אחרים יתנגנו - התעלם מהם והתמקד רק בזיהוי המטרה.\n\nלחץ על RETURN או לחץ על המשך. ',
    hi: 'ध्वनि पहचान\n\nआप कई परीक्षण पूरे करेंगे। प्रत्येक परीक्षण में, आपको एक लक्षित ध्वनि सुनाई दे भी सकती है और नहीं भी: एक स्वर 8 बार दोहराया जाएगा। आधे परीक्षणों में लक्षित ध्वनि शामिल होगी और आधे में नहीं।\n\nआपका कार्य: सुनने के बाद, यदि आपको लक्षित ध्वनि सुनाई दे तो "y" दबाएँ, या यदि नहीं सुनाई दे तो "n" दबाएँ। जैसे-जैसे आप आगे बढ़ेंगे, वॉल्यूम समायोजित होता जाएगा, जिससे लक्ष्य का पता लगाना मुश्किल हो जाएगा।\n\nअभ्यास खंड में, लक्ष्य अकेला होगा। बाद में, अन्य ध्वनियाँ भी बजेंगी—उन्हें अनदेखा करें और केवल लक्ष्य का पता लगाने पर ध्यान केंद्रित करें।\n\nरिटर्न दबाएँ या आगे बढ़ें पर क्लिक करें।',
