    es: 'DETECCIÓN DE SONIDO\n\nCompletarás varios ensayos. En cada uno, podrías oír o no un sonido objetivo: una nota repetida 8 veces. La mitad de los ensayos incluyen el sonido objetivo y la otra mitad no.\n\nTarea: Después de escuchar, pulsa "y" si oíste el sonido objetivo o "n" si no. El volumen se ajustará a medida que avances, haciendo que el objetivo sea apenas detectable.\n\nEn el bloque de práctica, el objetivo estará solo. Más adelante, también se reproducirán otros sonidos; ignóralos y concéntrate solo en detectar el objetivo.\n\nPulsa RETORNO o haz clic en CONTINUAR.',
